(2, 'Raincoat Double Layer Waterproof Printed Designs Bike Unisex', 0, 0, NULL, 'seller', 260, 18, 120, 785, 1198, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/5e43b8314637208b741009346db4e5a5.jpg\"]', 'https://static-01.daraz.com.np/p/5e43b8314637208b741009346db4e5a5.jpg', 'https://static-01.daraz.com.np/p/5e43b8314637208b741009346db4e5a5.jpg', 'https://static-01.daraz.com.np/p/5e43b8314637208b741009346db4e5a5.jpg', '', '', 'Motors , Motorcycle , Riding Gear , Rain Jackets', '<div></div>', '<p><strong>Protection and Security </strong>: This product can basically cover your body and protect you from the rain. It can keep you and your family healthy and away from acid rain. 360-degree reflective edging makes your riding safer at night.The front headlight has a large area of transparent film and strong light transmission. You can also be safely illuminated at night.</p>\n\n<p><strong>High quality and durable</strong> : New features to reject the rain, keep you away from rain;wear-resistant breathable layer is comfortable and breathable, anti-aging, can be used for a long time, will not easily broken;waterproof glue on the back seam The bar is also soft and stiff in the winter;the double-line is durable and beautiful.</p>\n\n<p><strong>East To Use :</strong>The visor mask can be detached to facilitate the helmet;the button on the neck can effectively prevent the entry of rainwater, and the integrated design can be conveniently worn to save time;after use, it can be folded and put into a high-quality bag to carry around. Compact and lightweight, saving space.</p>\n\n<p><strong>Multiple occasions :</strong>&nbsp;Ideal for use on rainy days, hiking, mountaineering, fishing, car shopping, emergency tasks, etc.;can be used as a raincoat, camping mat, sunshade, etc.</p>_<div></div>', 1800.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 1, 0, 112, '', 20.00, 'percent', NULL, NULL, 'flat_rate', 0.00, 0, 'Raincoat Double Layer Waterproof Printed Designs Bike Unisex price in Nepal