(60, 'Revlon Street Wear Satin Smooth Lipstick Red-30', 0, 0, NULL, 'seller', 261, 10, 71, 364, 598, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/081f3c9b501b5c0f037188e5fb5a23c6.jpg\"]', 'https://static-01.daraz.com.np/p/081f3c9b501b5c0f037188e5fb5a23c6.jpg', 'https://static-01.daraz.com.np/p/081f3c9b501b5c0f037188e5fb5a23c6.jpg', 'https://static-01.daraz.com.np/p/081f3c9b501b5c0f037188e5fb5a23c6.jpg', '', '', 'Health & Beauty , Makeup , Lips , Lipsticks,', '<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"font-family: none;\"></span><span style=\"color: #212121;font-family: roboto , arial , sans-serif;font-size: 14.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: start;text-indent: 0.0px;text-transform: none;white-space: normal;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;display: inline;float: none;\">The Street Wear Satin Smooth Lipstick is has a very creamy and rich formula that makes the lips look luscious and plump. Its rich creamy consistency will give you softer, smoother and fuller lips you will love to flaunt.</span></p>', '<ul>\n	<li>\n	<p>Street Wear has been creating bold revolutionary products for the modernistic woman.</p>\n	</li>\n	<li>\n	<p>Inspired by women who express power and independence, we aim to speak up in tandem with our innovative products formulated by our professionals so that you can create a style so fierce and unleash your version of being bold.</p>\n	</li>\n	<li>\n	<p>So here&rsquo;s presenting Streetwear Matte Lipstick, a highly-pigmented lipstick that delivers unparalleled color payoff in a plush-matte formula.</p>\n	</li>\n	<li>\n	<p>Enriched with moisturizers like jojoba oil, vitamins that make your lips soft and supple. Its creamy formula locks in moisture beneat