(149, 'The Body Shop-Strawberry Body Mist 60ml', 0, 0, NULL, 'seller', 261, 10, 69, 353, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/1eb2e095930ccdbd8ea4c7d5a62be9e6.jpg\"]', 'https://static-01.daraz.com.np/p/1eb2e095930ccdbd8ea4c7d5a62be9e6.jpg', 'https://static-01.daraz.com.np/p/1eb2e095930ccdbd8ea4c7d5a62be9e6.jpg', 'https://static-01.daraz.com.np/p/1eb2e095930ccdbd8ea4c7d5a62be9e6.jpg', '', '', 'Health & Beauty , Fragrances , Women,,', '<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"color: #222222;font-family: none;font-size: 18.6667px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: left;text-indent: 0.0px;text-transform: none;white-space: normal;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;display: inline;float: none;\">Good fragrances are like fresh condiments, they add their very own flavor to your mood. I am a fragrance fanatic and love to collect as many as I possibly can or my pocket would allow, be it a perfume or a body mist. Today I’ll be reviewing one of the recent additions to my body mist collection, the “</span><span>The Body Shop Strawberry Body Mist</span><span style=\"color: #222222;\">”. Subtle fruity fragrances are my absolute favorites and they have this immense power to enliven my mood even when I am at my lowest. And no, this is no exaggeration.</span></p>', '<ul>\n	<li>\n	<p>Strawberry takes on a fresh new form.</p>\n	</li>\n	<li>\n	<p>Spray this light scented body mist all over your body for a gentle burst of sweet fruitiness. Simply irresistible.</p>\n	</li>\n	<li>\n	<p>Sweet strawberry fragrance that&#39;s lightweight and fresh. Use all over body.</p>\n	</li>\n	<li>\n	<p>Contains strawberry extract.</p>\n	</li>\n</ul>_<p style=\"margin: 0;padding: 8.0px 0;white-space: pr