(160, 'Les Belles De Ricci . Eau De Toilette Spray 1.7 Ounces', 0, 0, NULL, 'seller', 261, 10, 69, 353, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/1a24c6661bc1bf8d42c4ba506bfc97eb.jpg\"]', 'https://static-01.daraz.com.np/p/1a24c6661bc1bf8d42c4ba506bfc97eb.jpg', 'https://static-01.daraz.com.np/p/1a24c6661bc1bf8d42c4ba506bfc97eb.jpg', 'https://static-01.daraz.com.np/p/1a24c6661bc1bf8d42c4ba506bfc97eb.jpg', '', '', 'Health & Beauty , Fragrances , Women,,', '', '<ul>\n	<li>\n	<p>Recommended use: daytime</p>\n	</li>\n	<li>\n	<p>.When&nbsp;applying&nbsp;any fragrance please consider that there are several factors which can affect the natural smell of your skin and, in turn, the way a scent smells on you.&nbsp;</p>\n	</li>\n	<li>\n	<p>For instance, your mood, stress level, age, body chemistry,&nbsp;diet, and current medications may all alter the scents you wear.&nbsp;&nbsp;Similarly, factor such as dry or oily&nbsp;skin can even affect the amount of time a fragrance will last after being applied</p>\n	</li>\n</ul>', 3475.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 1, 0, 5, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Les Belles De Ricci . Eau De Toilette Spray 1.7 Ounces price in Nepal', '<ul>\n	<li>\n	<p>Recommended use: daytime</p>\n	</li>\n	<li>\n	<p>.When&nbsp;applying&nbsp;any fragrance please consider that there are several factors which can affect the natural smell of your skin and, in turn, the way a scent smells on you.&nbsp;</p>\n	</li>\n	<li>\n	<p>For instance, your mood, stress level, age, body chemistry,&nbsp;diet, and current medications may all alter the scents you wear.&nbsp;&nbsp;Similarly, factor such as dry or oily&nbsp;skin can even affect the amount of time a fragrance will last after being applied</p>\n	</li>\n</ul>', NULL, NULL, 'les-belles-de-ricci-eau-de-toilette-spray-1-7-ounces12545', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:26:55', '2022-06-09 22:26:55'),
