(208, 'The Men Company Charcoal Soap 125g', 0, 0, NULL, 'seller', 261, 10, 65, 327, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/d5b22cee756c333d7404d9a5bfac0de0.jpg\"]', 'https://static-01.daraz.com.np/p/d5b22cee756c333d7404d9a5bfac0de0.jpg', 'https://static-01.daraz.com.np/p/d5b22cee756c333d7404d9a5bfac0de0.jpg', 'https://static-01.daraz.com.np/p/d5b22cee756c333d7404d9a5bfac0de0.jpg', '', '', 'Health & Beauty , Bath & Body , Body Soaps & Shower Gels,,', '', '<ul>\n	<li>The Charcoal Soap Bar is an innovative product that brings the powerful cleansing properties of Activated Charcoal agent in a soap form.</li>\n	<li>Charcoal and soap might seem like two words that do not go well together, but activated Charcoal is a tried and tested cleansing ingredient, known for its unique ability to draw out toxins from the body &ndash; out the dirt and oils that are blocking your skin&rsquo;s pores.</li>\n	<li>Charcoal Soap&rsquo;s anti-bacterial properties not only kills germs but also exfoliates your skin. Banish blemishes and toxins, and give your skin a smooth texture.</li>\n	<li>This soap is great for an all over skin detox, as well as for your hands as it can help reduce pigmentation and make them look younger.</li>\n	<li>So, if you are someone who&rsquo;d like to enjoy all or any of these benefits, the Charcoal Soap Bar is perfect for you!</li>\n	<li>The Charcoal Soap Bar is perfect for times when you&rsquo;d want to take a thoroughly cleansing shower at the end of a messy, grimy day.</li>\n</ul>', 549.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 1, 0, 5, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'The Men Company Charcoal Soap 125g price in Nepal', '', NULL, NULL, 'the-men-company-charcoal-soap-125g12593', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:26:55', '2022-06-09 22:26:55'),
