liate your lips, use a cotton swab to scrub off the remaining dead skin cells.</span></li><li style=\"box-sizing: border-box;margin: 0.0px;padding: 0.0px 0.0px 0.0px 16.0px;line-height: 1.8;\"><span>After use, close the jar lid and store it.</span></li></ul></div>', 2995.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 1, 0, 1, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Purederm Plumpink Glitter Lip Gel Patch 30N price in Nepal', '', NULL, NULL, 'purederm-plumpink-glitter-lip-gel-patch-30n12608', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:26:55', '2022-06-09 22:26:55'),
