(235, 'Chemist At Play Acne Control Face Serum 30ml', 0, 0, NULL, 'seller', 261, 10, 76, 401, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/303a764546dda62cc7c94b50237dc8f4.jpg\"]', 'https://static-01.daraz.com.np/p/303a764546dda62cc7c94b50237dc8f4.jpg', 'https://static-01.daraz.com.np/p/303a764546dda62cc7c94b50237dc8f4.jpg', 'https://static-01.daraz.com.np/p/303a764546dda62cc7c94b50237dc8f4.jpg', '', '', 'Health & Beauty , Skin Care , Serum & Essence,,', '<div style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"color: #272727;font-family: poppins , sans-serif;font-size: 14.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: left;text-indent: 0.0px;text-transform: none;white-space: normal;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;display: inline;float: none;\">Our Acne Control Face Serum is legit a miracle in a bottle that combines two of the most promising ingredients that help fight off acne; Azelaic Acid and Niacinamide. So, it is definitely the face serum for oily skin. Azelaic Acid deeply cleans the pores that may result in breakouts and also reduces skin inflammation. Whereas, niacinamide for skin helps regulate oil secretion, Also, niacinamide serum benefits the skin by minimizing the appearance of pores and fading away facial scars.</span></div>', '<ul>\n	<li>Suitable for oily skin</li>\n	<li>Cleanses pores</li>\n	<li>Regulates oil secretion</li>\n	<li>Helps fade acne scars</li>\n	<li>For best results, use our azelaic acid product once daily. If you have sensitive skin, then use it 3-4 times a week.</li>\n	<li>Apply 3-4 drops of the niacinamide serum after cleansing and toning your face.&nbsp;</li>\n	<li>Evenly spread by gently tapping on the skin and allow it to absorb. Follow it up with a ceramides-based moisturiser and SPF (AM)</li>\n</ul>_<div style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"color: #272727;font-family: poppins , sans-serif;font-size: 14.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: left;text-indent: 0.0px;text-transform: none;white-space: normal;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;display: inline;float: none;\">Our Acne Control Face Serum is legit a miracle in a bottle that combines two of the most promising ingredients that help fight off acne; Azelaic Acid and Niacinamide. So, it is definitely the face serum for oily skin. Azelaic Acid deeply cleans the pores that may result in breakouts and also reduces skin inflammation. Whereas, niacinamide for skin helps regulate oil secretion, Also, niacinamide serum benefits the skin by minimizing the appearance of pores and fading away facial scars.</span></div>', 945.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 1, 0, 3, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Chemist At Play Acne Control Face Serum 30ml price in Nepal', '', NULL, NULL, 'chemist-at-play-acne-control-face-serum-30ml12620', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:26:55', '2022-06-09 22:26:55'),
