ul>_<div></div>', 950.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 1, 0, 2, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Urban Botanics Advanced 20% Niacinamide Serum 30ml price in Nepal', '', NULL, NULL, 'urban-botanics-advanced-20-niacinamide-serum-30ml12627', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:26:56', '2022-06-09 22:26:56'),
