(264, 'Furr By Peesafe Charcoal Nose Strips 3N', 0, 0, NULL, 'seller', 261, 10, 76, 396, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/f23eef50f67bfc4b028f9224399ee3df.png\"]', 'https://static-01.daraz.com.np/p/f23eef50f67bfc4b028f9224399ee3df.png', 'https://static-01.daraz.com.np/p/f23eef50f67bfc4b028f9224399ee3df.png', 'https://static-01.daraz.com.np/p/f23eef50f67bfc4b028f9224399ee3df.png', '', '', 'Health & Beauty , Skin Care , Face Mask & Packs,,', '<div style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><strong style=\"box-sizing: inherit;font-weight: bolder;\">DISCLAIMER:</strong><li style=\"box-sizing: inherit;font-size: 14.0px;margin-bottom: 20.0px;\"><span>Before applying the strip, make sure to clean your face. Do not use it if you’ve got cuts, scratches or inflamed skin. In the event of an allergy or irritation, contact your general physician. Make sure your skin is not dry before applying it to your nose.</span></li><li style=\"box-sizing: inherit;font-size: 14.0px;margin-bottom: 20.0px;\"><span>After removing the strip, wipe your nose clean in case some residue remains on your skin.</span></li></div>', '<ul>\n	<li>Sometimes, relying on our face wash to keep tiny yet annoying blackheads and whiteheads at bay just doesn&rsquo;t work. Instead of scrubbing your nose thrice a day or trying out remedies that dry out your skin, trust Furr to love and pamper your skin.</li>\n	<li>Introducing Charcoal Nose Strips infused with Aloe Vera and Tea Tree Oil that naturally reduce blackheads, whiteheads, oil and dirt, keeping your nose clean and fresh at all times.</li>\n	<li>These paraben and sulfate-free nose strips are gentle on your skin and suitable for all skin types. If you&rsquo;ve got cuts, scratches or inflamed skin, make sure to wait till they heal and then apply the strips.</li>\n</ul>_<div style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><strong style=\"box-sizing: inherit;font-weight: bolder;\">DISCLAIMER:</strong><li style=\"box-sizing: inherit;font-size: 14.0px;margin-bottom: 20.0px;\"><span>Before applying the strip, make sure to clean your face. Do not use it if you’ve got cuts, scratches or inflamed skin. In the event of an allergy or irritation, contact your general physician. Make sure your skin is not dry before applying it to your nose.</span></li><li style=\"box-sizing: inherit;font-size: 14.0px;margin-bottom: 20.0px;\"><span>After removing the strip, wipe your nose clean in case some residue remains on your skin.</span></li></div>', 320.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 1, 0, 2, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Furr By Peesafe Charcoal Nose Strips 3N price in Nepal', '', NULL, NULL, 'furr-by-peesafe-charcoal-nose-strips-3n12649', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:26:56', '2022-06-09 22:26:56'),
