(267, 'The Skin House-Pore Tightening Clay Face Pack 100ml', 0, 0, NULL, 'seller', 261, 10, 76, 396, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/7e14454bbc30e168278216f481815707.jpg\"]', 'https://static-01.daraz.com.np/p/7e14454bbc30e168278216f481815707.jpg', 'https://static-01.daraz.com.np/p/7e14454bbc30e168278216f481815707.jpg', 'https://static-01.daraz.com.np/p/7e14454bbc30e168278216f481815707.jpg', '', '', 'Health & Beauty , Skin Care , Face Mask & Packs,,', '', '<ul>\n	<li>Blackhead remover, acne treatment face deep clean pore purifier and wash off type clay mask pack.</li>\n	<li>Creating a gentle exfoliation effect that removes excess oil, toxins, and dead skin cells for a softer feel and radiant glow. Our spa quality clay pack removes dead skin cells, dirt and toxins to reveal fresh, soft skin. Gentle for even sensitive &amp; acne prone skin, this bentonite and kaoilin clay mask gently exfoliates and minimizes the appearance of visible pores., reducing inflammation allowing skin to heal quickly.</li>\n	<li>Aloe vera helps to reduce UV damage and preventing damages. Shea butter locks in the moisture in the skin and keeps it hydrated for long.&nbsp;Tea tree extract helps to calm redness, swelling, and inflammation.</li>\n	<li>Apply an adequate amount of the content to the dry face. Spread it thickly to the whole face except the eyes and nose part. After 15~20 minutes, rinse off with lukewarm water cleanly. (1~2 times per week) It is recommended to use as a nose cleansing strips on the blackheads which pore care is especially needed.</li>\n	<li>Suitable for normal, combination, oily especially to someone who concerns about the pores</li>\n</ul>', 3300.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 1, 0, 3, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'The Skin House-Pore Tightening Clay Face Pack 100ml price in Nepal', '', NULL, NULL, 'the-skin-house-pore-tightening-clay-face-pack-100ml12652', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:26:56', '2