(270, 'The Men Company Charcoal Peel Off Mask 100g', 0, 0, NULL, 'seller', 261, 10, 76, 396, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/318ed1a5064f6f51c5988e6430c7acc2.jpg\"]', 'https://static-01.daraz.com.np/p/318ed1a5064f6f51c5988e6430c7acc2.jpg', 'https://static-01.daraz.com.np/p/318ed1a5064f6f51c5988e6430c7acc2.jpg', 'https://static-01.daraz.com.np/p/318ed1a5064f6f51c5988e6430c7acc2.jpg', '', '', 'Health & Beauty , Skin Care , Face Mask & Packs,,', '<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"color: #333333;font-family: none;font-size: 13.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: left;text-indent: 0.0px;text-transform: none;white-space: normal;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;display: inline;float: none;\">The mens charcoal peel off mask, from the house of The Man Company is one of the most efficient ways of removing deep settled impurities from your skin. It also is a great way to remove blackheads from your face and de-tan your skin. It will brighten your skin by rubbing out dead cells and give you a fair glow.</span></p>', '<ul>\n	<li>Peel-off masks are extremely important in the skin treatment regime.</li>\n	<li>They not only help in removing the dirt and dead skin cells but also clear the blackheads and prevent the early signs of acne and pimples.</li>\n	<li>Blackhead removal mask, when mixed with the goodness of activated charcoal (or activated carbon), works as a wonder product in getting you a clearer and dirt-free face.</li>\n	<li>Plus, the addition of the Moringa and Gooseberry gets the peel off mask a notch higher for its benefits as they help in fighting away the overactive sebaceous glands and the ageing effects hence, is of utmost importance in face care 