(273, 'The Body Shop-Tea Tree Clay Mask 100ml', 0, 0, NULL, 'seller', 261, 10, 76, 396, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/01f9853c1ae93a2922e1b3ea6e27396d.jpg\"]', 'https://static-01.daraz.com.np/p/01f9853c1ae93a2922e1b3ea6e27396d.jpg', 'https://static-01.daraz.com.np/p/01f9853c1ae93a2922e1b3ea6e27396d.jpg', 'https://static-01.daraz.com.np/p/01f9853c1ae93a2922e1b3ea6e27396d.jpg', '', '', 'Health & Beauty , Skin Care , Face Mask & Packs,,', '', '<ul>\n	<li>Perfect for oily and blemish-prone skin</li>\n	<li>Purifies and refreshes skin for that deep clean feeling</li>\n	<li>Helps your blemished skin feel purified, refreshed and ready to get back out there</li>\n	<li>Smooth a thin layer onto pat-dried skin, clean face and neck with your fingertips. Leave for 5 to 10 minutes (mask will not dry). Then rinse off with clean water and pat skin dry. Use once or twice per week, after cleansing.</li>\n	<li>When paired with The Body Shop&#39;s Tea Tree Skin Clearing Foaming Cleanser, you&#39;ll find a whole team of blemish-fighting machines</li>\n	<li>Cruelty Free</li>\n</ul>', 1695.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 1, 0, 1, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'The Body Shop-Tea Tree Clay Mask 100ml price in Nepal', '', NULL, NULL, 'the-body-shop-tea-tree-clay-mask-100ml12658', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:26:56', '2022-06-09 22:26:56'),
(274, 'The Body Shop-Drops of Youth Sleeping Mask 75ml', 0, 0, NULL, 'seller', 261, 10, 76, 396, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/2a2521522db5900b4474098e9770281c.jpg\"]', 'https://static-01.daraz.com.np/p/2a2521522db5900b4474098e9770281c.jpg', 'https://static-01.daraz.com.np/p/2a2521522db5900b4474098e9770281c.jpg', 'https://static-01.daraz.com.np/p/2a2521522db5900b4474098e9770281c.jpg', '', '', 'Health & Beauty , Skin Care , Face Mask & Packs,,', '<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"font-family: none;\">This refreshing overnight facemask has been formulated to address the first signs of ageing, for skin that feels softer and smoother when you wake up. An innovative bouncy, memory-shape gel cream that moulds itself like a second skin, leaving an instant refreshing feel with a soft finish. Wake up to skin that feels replumped, replenished and renewed. For all skin types and first signs of ageing Overnight Face Mask Smooths and refreshes skin Follow our easy step-by-step guide for younger-looking skin!</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"font-family: none;\">This bouncy gel feels absolutely amazing on the eye contours because it is so cooling and soothing. The texture, which is like a melting jelly, blends into the skin beautifully and instantly refreshes the whole eye area. It leaves the skin looking hydrated and plump without leaving behind any tackiness or residue.</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"font-family: none;\"></span></p>', '<ul>\n	<li>Springy eye cream</li>\n	<li>Multi-use formula</li>\n	<li>Can be applied during the day</li>\n	<li>Can be used as a mask overnight</li>\n	<li>Instantly cools &amp; hydrates tired eyes</li>\n	<li>Memory-shape texture blends effortlessly into the skin</li>\n	<li>Leaves a non-sticky soft finish</li>\n	<li>Enriched with calming cucumber extract</li>\n	<li>3 types of plant stem cells renew the skin</li>\n</ul>_<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"font-family: none;\">This refreshing overnight facemask has been formulated to address the first signs of ageing, for skin that feels softer and smoother when you wake up. An innovative bouncy, memory-shape gel cream that moulds itself like a second skin, leaving an instant refreshing feel with a soft finish. Wake up to skin that feels replumped, replenished and renewed. For all skin types and first signs of ageing Overnight Face Mask Smooths and refreshes skin Follow our easy step-by-step guide for younger-looking skin!</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"font-family: none;\">This bouncy gel feels absolutely amazing on the eye contours because it is so cooling and soothing. The texture, which is like a melting jelly, blends into the skin beautifully and instantly refreshes the whole eye area. It leaves the skin looking hydrated and plump without leaving behind any tackiness or residue.</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"font-family: none;\"></span></p>', 4890.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 1, 0, 2, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'The Body Shop-Drops of Youth Sleeping Mask 75ml price in Nepal', '', NULL, NULL, 'the-body-shop-drops-of-youth-sleeping-mask-75ml12659', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:26:56', '2022-06-09 22:26:56'),
(275, 'Dot & Key Skin Plumping Moisture Infusion Water Sleeping Mask, Hyaluronic Acid Overnight Hydrating Mask, Night Gel 60ml, Paraben Free', 0, 0, NULL, 'seller', 261, 10, 76, 396, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/567ae65b86030e4a029c20eaec9d5c5e.jpg\"]', 'https://static-01.daraz.com.np/p/567ae65b86030e4a029c20eaec9d5c5e.jpg', 'https://static-01.daraz.com.np/p/567ae65b86030e4a029c20eaec9d5c5e.jpg', 'https://static-01.daraz.com.np/p/567ae65b86030e4a029c20eaec9d5c5e.jpg', '', '', 'Health & Beauty , Skin Care , Face Mask & Packs,,', '', '<ul>\n	<li>A luxurious gel-like sleep mask that hydrates skin overnight to revive its fresh and rested appearance.</li>\n	<li>This face mask hydrates and noursihes skin to reduce signs of stress and exhaustion, while also reversing the damaging effects of UV rays, pollution and smoke.</li>\n	<li>The hydrating hyaluronic acid intensely plumps up skin with water, the divine bulgarian rose moisturizes skin, the anti-inflammatory chamomile remove tiredness and the antioxidant rich cucumber reduce puffiness and dullness.</li>\n	<li>It works overnight to give skin the much needed rest and hydration, so that you wake up a plump, supple looking skin.</li>\n	<li>Made with no nasty chemicals, Dot &amp; Key&#39;s products use natural botanical without any cruelty to our furry friends.</li>\n</ul>', 2575.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Dot & Key Skin Plumping Moisture Infusion Water Sleeping Mask, Hyaluronic Acid Overnight Hydrating Mask, Night Gel 60ml, Paraben Free price in Nepal', '', NULL, NULL, 'dot-key-skin-plumping-moisture-infusion-water-sleeping-mask-hyaluronic-acid-overnight-hydrating-mask-night-gel-60ml-paraben-free12660', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:26:56', '2022-06-09 22:26:56'),
(276, 'The Body Shop Tea Tree 3 in 1 Face Wash Scrub  125ml', 0, 0, NULL, 'seller', 261, 10, 76, 396, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/b9cf8cda086cb5902bed10d135b90904.jpg\"]', 'https://static-01.daraz.com.np/p/b9cf8cda086cb5902bed10d135b90904.jpg', 'https://static-01.daraz.com.np/p/b9cf8cda086cb5902bed10d135b90904.jpg', 'https://static-01.daraz.com.np/p/b9cf8cda086cb5902bed10d135b90904.jpg', '', '', 'Health & Beauty , Skin Care , Face Mask & Packs,,', '', '<ul>\n	<li>Tea Tree 3-in-1 Wash Scrub Mask is a bit of an overachiever. It&rsquo;s a face wash, scrub AND mask for blemished skin, all in one handy tube - that&rsquo;s your skincare sorted.</li>\n	<li>When used as a wash, the foaming product removes impurities and excess oil; as a scrub, the exfoliants&nbsp;unclog pores to leave skin feeling smoother.</li>\n	<li>\n	<p>When applied as a mask, the drying clay deeply cleanses and mattifies and helps maintain clearer looking skin.</p>\n	</li>\n</ul>', 2395.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 1, 0, 4, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'The Body Shop Tea Tree 3 in 1 Face Wash Scrub  125ml price in Nepal', '', NULL, NULL, 'the-body-shop-tea-tree-3-in-1-face-wash-scrub-125ml12661', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:26:56', '2022-06-09 22:26:56');
