(311, 'Loreal Paris Age Perfect Cell Renew Day Spf-15 50ml', 0, 0, NULL, 'seller', 261, 10, 76, 400, 663, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/1847d5c952a1af5cf3d2df5b83f5be12.jpg\"]', 'https://static-01.daraz.com.np/p/1847d5c952a1af5cf3d2df5b83f5be12.jpg', 'https://static-01.daraz.com.np/p/1847d5c952a1af5cf3d2df5b83f5be12.jpg', 'https://static-01.daraz.com.np/p/1847d5c952a1af5cf3d2df5b83f5be12.jpg', '', '', 'Health & Beauty , Skin Care , Moisturizers and Cream , Moisturizers,', '<div></div>', '<ul>\n	<li>\n	<p>Instantly the skin feels softer, nourished and more comfortable</p>\n	</li>\n	<li>\n	<p>Day after day, surface skin cells are renewed</p>\n	</li>\n	<li>\n	<p>Radiance is regenerated, skin feels more toned and looks full of life</p>\n	</li>\n	<li>\n	<p>Discover our day cream to stimulate cell renewal &amp; prolong skin&#39;s vitality. With age, skin cell renewal slows down and it can take longer for fresh, newer cells to form. Consequently, skin looks tired, lacklustre and begins to lose its vitality, making you look older than you may feel.</p>\n	</li>\n	<li>\n	<p>The Restoring Power of Black Truffle and Fermented Black Tea<br />\n	The precious Black Truffle can remain fully intact for 200 days in the wild. The rare natural wonder is renowned for its regenerating properties.</p>\n	</li>\n	<li>\n	<p>Fermented Black Tea is commonly known as the &quot;Tea of Immortality&quot; in traditional Chinese medicine. Its concentrated fermentation gives it exceptional revitalising properties.</p>\n	</li>\n	<li>\n	<p>L&#39;Or&eacute;al Paris laboratories have formulated and combined these two active ingredients, rich in Polyphenols and Vitamin B, into a revitalising day cream that creates the optimal conditions to stimulate skin&#39;s natural cell renewal, prolonging its vitality. Thanks to SPF 15, the skin is protected against the harmful effects of UV rays.</p>\n	</li>\n	<li>\n	<p>Visible Results<br />\n	- Instantly the skin feels softer, nourished and more comfortable.<br />\n	- Day after day, surface skin cells are renewed. Radiance is regenerated, skin feels more toned and looks full of life.</p>\n	</li>\n	<li>\n	<p>Discover Age Perfect Cell Renew Revitalising Day Cream with SPF 15. Formulated with black truffle and fermented black tea, for an indulgent solution for tired and mature skin.</p>\n	</li>\n</ul>_<div></div>', 2390.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 0, 0, 1, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Loreal Paris Age Perfect Cell Renew Day Spf-15 50ml price in Nepal', '', NULL, NULL, 'loreal-paris-age-perfect-cell-renew-day-spf-15-50ml12696', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:26:56', '2022-06-09 22:26:56'),
