(316, 'Loreal Paris Revitalift LaserX3 Day Cream 50ml', 0, 0, NULL, 'seller', 261, 10, 76, 400, 663, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/d20a60c2947bf45cf8fdbdf04e40cdf3.jpg\"]', 'https://static-01.daraz.com.np/p/d20a60c2947bf45cf8fdbdf04e40cdf3.jpg', 'https://static-01.daraz.com.np/p/d20a60c2947bf45cf8fdbdf04e40cdf3.jpg', 'https://static-01.daraz.com.np/p/d20a60c2947bf45cf8fdbdf04e40cdf3.jpg', '', '', 'Health & Beauty , Skin Care , Moisturizers and Cream , Moisturizers,', '<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span>L\'Oréal Paris Revitalift Laser Renew Anti-Aging Day Cream smoothes your wrinkles just like after a laser treatment! This exceptional skin cream effectively smoothes wrinkles, restores skin elasticity and unifies its color tone.</span></p><p style=\"color: #333333;margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span>Revitalift Laser Renew cream contains Pro-Xylane technology, which stimulates skin renewal, reduces mimic wrinkles, restores skin density and restores supportive skin fibers. Hyaluronic acid effectively penetrates all layers of the skin, intensively hydrates the skin and reduces wrinkles.</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span></span></p>', '<ul>\n	<li>\n	<p>You will see the visible results of the Revitalift Laser Renew cream after only 4 weeks! Suitable for the age category from 40 to 60 years. Get young again with the extremely effective Revitalift Laser Renew cream from L&#39;Or&eacute;al Paris!</p>\n	</li>\n	<li>smoothes wrinkles</li>\n	<li>restores skin texture</li>\n	<li>smoothes contours</li>\n	<li>restores skin elasticity</li>\n	<li>firms the skin</li>\n	<li>hydrates and unifies</li>\n</ul>_<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span>L\'Oréal Paris Revitalift Laser Renew Anti-Aging Day Cream smoothes your wrinkles just like after a laser treatment! This exceptional skin cream effectively smoothes wrinkles, restores skin elasticity and unifies its color tone.</span></p><p style=\"color: #333333;margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span>Revitalift Laser Renew cream contains Pro-Xylane technology, which stimulates skin renewal, reduces mimic wrinkles, restores skin density and restores supportive skin fibers. Hyaluronic acid effectively penetrates all layers of the skin, intensively hydrates the skin and reduces wrinkles.</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span></span></p>', 1490.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 0, 0, 5, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Loreal Paris Revitalift LaserX3 Day Cream 50ml price in Nepal', '', NULL, NULL, 'loreal-paris-revitalift-laserx3-day-cream-50ml12701', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:26:57', '2022-06-09 22:26:57'),
(317, 'Loreal Paris Hyaluloran Expert Specialist Day Cream 50ml', 0, 0, NULL, 'seller', 261, 10, 76, 400, 663, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/2bc31d9032b6dc6298f8161a685f0446.jpg\"]', 'https://static-01.daraz.com.np/p/2bc31d9032b6dc6298f8161a685f0446.jpg', 'https://static-01.daraz.com.np/p/2bc31d9032b6dc6298f8161a685f0446.jpg', 'https://static-01.daraz.com.np/p/2bc31d9032b6dc6298f8161a685f0446.jpg', '', '', 'Health & Beauty , Skin Care , Moisturizers and Cream , Moisturizers,', '<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span>Hyaluron Expert Day Cream is used to intensely hydrate, smoothen and replump the skin with added SPF protection from UVA/UVB. Powered by 2 types of hyaluronic acids: Macro Hyaluronic acid hydrates and smoothes skin surface & Micro Hyaluronic Acid plumps out from within:</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span>• Macro hyaluronic acid to help moisturize and smoothen skin\'s surface</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span>• Micro hyaluronic acid helps replump skin by infusing moisture deep into the skin</span><span></span><span></span><span>Benefits:</span><span></span><span>• Replumping Moisturizing Day Care</span><span></span><span>• Smooths Fine Lines</span><span></span><span>• Intensively Hydrates</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span>How to use:</span></p><ul style=\"list-style: disc;margin-left: 10.0px;\"><li><span>Apply every morning with circular movements on a thoroughly cleansed face and neck.</span></li></ul><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span></span></p>', '<ul>\n	<li>Replumping moisturizing care</li>\n	<li>Smooths fine lines</li>\n	<li>Intensively hydrates</li>\n	<li>Texture: Lightweight And Non-Greasy</li>\n	<li>Hyaluron Expert Powered By High Concentration Of</li>\n	<li>Types Of Hyaluronic Acid:</li>\n	<li>High Molecular Hyaluronic Acid To Hel