(318, 'The Body Shop-Tea Tree Night Blemish Fade Lotion 30ml', 0, 0, NULL, 'seller', 261, 10, 76, 400, 663, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/b8c9bf158b03b83643deb58355fd9a7a.jpg\"]', 'https://static-01.daraz.com.np/p/b8c9bf158b03b83643deb58355fd9a7a.jpg', 'https://static-01.daraz.com.np/p/b8c9bf158b03b83643deb58355fd9a7a.jpg', 'https://static-01.daraz.com.np/p/b8c9bf158b03b83643deb58355fd9a7a.jpg', '', '', 'Health & Beauty , Skin Care , Moisturizers and Cream , Moisturizers,', '<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"font-family: none;\"></span></p><p style=\"box-sizing: border-box;margin-top: 0.0px;margin-bottom: 1.5rem;color: #004236;font-family: worksansregular;font-size: 16.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: left;text-indent: 0.0px;text-transform: none;white-space: pre-wrap;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;margin: 0;padding: 8.0px 0;\"><span>Our Tea Tree Night Lotion helps you snooze your way to dreamy looking skin. Blemishes? Time for this little guy to get to work.</span></p><p style=\"box-sizing: border-box;margin-top: 0.0px;margin-bottom: 1.5rem;color: #004236;font-family: worksansregular;font-size: 16.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: left;text-indent: 0.0px;text-transform: none;white-space: pre-wrap;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;margin: 0;padding: 8.0px 0;\"><span>While you sleep your skin is in recovery mode and so it’s the perfect time to slather on some hard-working skincare. This lightweight night lotion helps your skin feel moisturised while absorbing excess oil and sebum, so you can wake up to refreshed skin that looks and more balanced. Sounds like a dream, right?</span></p><p style=\"box-sizing: border-box;margin-top: 0.0px;margin-bottom: 1.5rem;color: #004236;font-family: worksansregular;font-size: 16.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: left;text-indent: 0.0px;text-transform: none;white-space: pre-wrap;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;margin: 0;padding: 8.0px 0;\"><span>Sourced from thousands of tea tree leaves in Kenya, The Body Shop’s Tea Tree Night Lotion is enriched with Community Fair Trade tea tree oil. This not only helps the local farmers, but also funds community projects in the local area. It’s a real winner, and your skin will thank you too.</span></p><p style=\"box-sizing: border-box;margin-top: 0.0px;margin-bottom: 1.5rem;color: #004236;font-family: worksansregular;font-size: 16.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: left;text-indent: 0.0px;text-transform: none;white-space: pre-wrap;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;margin: 0;padding: 8.0px 0;\"><span>And if you’re on the hunt for more than just a night lotion, The Body Shop’s Tea Tree range is full of more blemish-battling goodies.</span></p><ul style=\"box-sizing: border-box;margin-bottom: 1.0rem;margin-top: 0.0px;color: #004236;font-family: worksansregular;font-size: 16.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;l