(358, 'Bella Vita Organic Face Wash Oilcontrol 115g', 0, 0, NULL, 'seller', 261, 10, 76, 398, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/4c3ce7d02281b90a9bf866ecb7900227.jpg\"]', 'https://static-01.daraz.com.np/p/4c3ce7d02281b90a9bf866ecb7900227.jpg', 'https://static-01.daraz.com.np/p/4c3ce7d02281b90a9bf866ecb7900227.jpg', 'https://static-01.daraz.com.np/p/4c3ce7d02281b90a9bf866ecb7900227.jpg', '', '', 'Health & Beauty , Skin Care , Facial Cleansers,,', '<div style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span></span><span style=\"margin: 0.0px;padding: 0.0px;color: #000000;font-style: normal;font-variant: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: start;text-indent: 0.0px;text-transform: none;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: transparent;text-decoration: none;font-size: 12.0pt;font-family: arial;vertical-align: baseline;white-space: pre-wrap;\">The oil on the skin comes from the sebaceous glands under our skin. The oil is clinically called sebum. Excessive production of sebum leads to oily skin. Oil on the face can lead to multiple skin concerns such as clogged pores, acne, sticking of dirt, dust & pollutants, dull skin, and more.</span><span style=\"margin: 0.0px;padding: 0.0px;color: #000000;\"></span><p style=\"margin: 0;padding: 8.0px 0;font-size: 14.0px;color: #000000;\"><span style=\"margin: 0.0px;padding: 0.0px;font-size: 12.0pt;font-family: arial;color: #000000;background-color: transparent;font-weight: 400;font-style: normal;font-variant: normal;text-decoration: none;vertical-align: baseline;white-space: pre-wrap;\">The first and most important rule: Remember to wash your face! Cleansing your face with the right oil control face wash is the best way to keep breakouts away. Bella Vita Organic’s charcoal face wash purifies skin by removing excess oil naturally. The Oil Control Face Wash is made with high-quality charcoal that extracts toxins from your pores whi