ng effects.</span></p><p style=\"margin: 0;padding: 8.0px 0;font-size: 14.0px;color: #000000;\"><span style=\"margin: 0.0px;padding: 0.0px;font-size: 12.0pt;font-family: arial;color: #000000;background-color: transparent;font-weight: 400;font-style: normal;font-variant: normal;text-decoration: none;vertical-align: baseline;white-space: pre-wrap;\">It is ideal to use oil control face wash as a daily cleanser twice a day.</span></p></div>', 480.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 1, 0, 2, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Bella Vita Organic Face Wash Oilcontrol 115g price in Nepal', '', NULL, NULL, 'bella-vita-organic-face-wash-oilcontrol-115g12743', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:26:57', '2022-06-09 22:26:57'),
