(364, 'Bella Vita Organic Face Wash Dry Glow 115g', 0, 0, NULL, 'seller', 261, 10, 76, 398, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/47a669a60ed9c45b4ec7c27af5160faa.jpg\"]', 'https://static-01.daraz.com.np/p/47a669a60ed9c45b4ec7c27af5160faa.jpg', 'https://static-01.daraz.com.np/p/47a669a60ed9c45b4ec7c27af5160faa.jpg', 'https://static-01.daraz.com.np/p/47a669a60ed9c45b4ec7c27af5160faa.jpg', '', '', 'Health & Beauty , Skin Care , Facial Cleansers,,', '<div style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span></span><span style=\"margin: 0.0px;padding: 0.0px;color: #000000;font-style: normal;font-variant: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: start;text-indent: 0.0px;text-transform: none;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: transparent;text-decoration: none;font-size: 12.0pt;font-family: arial;vertical-align: baseline;white-space: pre-wrap;\">Dry skin can be troublesome to take care of. The constant feeling of your skin being stretched, itchy and flaky is very unsettling. Having dry skin can cause certain concerns as well like acne, dullness, scaling or peeling, etc. Using moisturizing soaps and body washes, taking shorter baths, reducing the use of hot water on the skin, moisturizing right after the shower, patting the skin with a soft towel instead of rubbing it, etc. can make a huge difference on dry skin.</span><span style=\"margin: 0.0px;padding: 0.0px;color: #000000;\"></span><p style=\"margin: 0;padding: 8.0px 0;font-size: 14.0px;color: #000000;\"><span style=\"margin: 0.0px;padding: 0.0px;font-size: 12.0pt;font-family: arial;color: #000000;background-color: transparent;font-weight: 400;font-style: normal;font-variant: normal;text-decoration: none;vertical-align: baseline;white-space: pre-wrap;\">Dry Glow Face Wash by Bella Vita Organic is a mild cleanser that doesn\'t strip away your skin\'s natural oils and further moisturizes it. It smoothens and softens the skin while deep cleaning the pores and removing dead skin cells. It also nourishes and brightens the skin while adding a natural glow to it.</span></p><p style=\"margin: 0;padding: 8.0px 0;font-size: 14.0px;color: #000000;\"><span style=\"margin: 0.0px;padding: 0.0px;font-size: 12.0pt;font-family: arial;color: #000000;background-color: transparent;font-weight: 400;font-style: normal;font-variant: normal;text-decoration: none;vertical-align: baseline;white-space: pre-wrap;\">The magic combination of turmeric, saffron, and papaya moisturizes and brightens your skin along with reducing pigmentation, blemishes, and dark spots. Sandalwood, Aloe vera and Vit. E help clear your skin, making it smooth and soft.</span></p></div>', '<ul>\n	<li>Cleanses Face Deeply</li>\n	<li>Improves Skin Tone</li>\n	<li>Doesn&#39;t Dry Skin Further</li>\n	<li>Hydrates, Nourishes, &amp; Detans Skin</li>\n	<li>Smoothens, Softens, &amp; Brightens Skin</li>\n	<li>Suitable for normal to dry skin types</li>\n</ul>_<div style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span></span><span style=\"margin: 0.0px;padding: 0.0px;color: #000000;font-style: normal;font-variant: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: start;text-indent: 0.0px;text-transform: none;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: transparent;text-decoration: none;font-size: 12.0pt;font-family: arial;vertical-align: baseline;white-space: pre-wrap;\">Dry skin can be troublesome to take care of. The constant feeling of your skin being stretched, itchy and flaky is very unsettling. Having dry skin can cause certain concerns as well like acne, dullness, scaling or peeling, etc. Using moisturizing soaps and body washes, taking shorter baths, reducing the use of hot water on the skin, moisturizing right after the shower, patting the skin with a soft towel instead of rubbing it, etc. can make a huge difference on dry skin.</span><span style=\"margin: 0.0px;padding: 0.0px;color: #000000;\"></span><p style=\"margin: 0;padding: 8.0px 0;font-size: 14.0px;color: #000000;\"><span style=\"margin: 0.0px;padding: 0.0px;font-size: 12.0pt;font-family: arial;color: #000000;background-color: transparent;font-weight: 400;font-style: normal;font-variant: normal;text-decoration: none;vertical-align: baseline;white-space: pre-wrap;\">Dry Glow Face Wash by Bella Vita Organic is a mild cleanser that doesn\'t strip away your skin\'s natural oils and further moisturizes it. It smoothens and softens the skin while deep cleaning the pores and removing dead skin cells. It also nourishes and brightens the skin while adding a natural glow to it.</span></p><p style=\"margin: 0;padding: 8.0px 0;font-size: 14.0px;color: #000000;\"><span style=\"margin: 0.0px;padding: 0.0px;font-size: 12.0pt;font-family: arial;color: #000000;background-color: transparent;font-weight: 400;font-style: normal;font-variant: normal;text-decoration: none;vertical-align: baseline;white-space: pre-wrap;\">The magic combination of turmeric, saffron, and papaya moisturizes and brightens your skin along with reducing pigmentation, blemishes, and dark spots. Sandalwood, Aloe vera and Vit. E help clear your skin, making it smooth and soft.</span></p></div>', 480.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 1, 0, 2, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Bella Vita Organic Face Wash Dry Glow 115g price in Nepal', '', NULL, NULL, 'bella-vita-organic-face-wash-dry-glow-115g12749', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:26:57', '2022-06-09 22:26:57'),
