(367, 'Bella Vita Organic Face Wash Antiacne 115g', 0, 0, NULL, 'seller', 261, 10, 76, 398, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/097dc71d731853cc4a5fe92614fb9016.jpg\"]', 'https://static-01.daraz.com.np/p/097dc71d731853cc4a5fe92614fb9016.jpg', 'https://static-01.daraz.com.np/p/097dc71d731853cc4a5fe92614fb9016.jpg', 'https://static-01.daraz.com.np/p/097dc71d731853cc4a5fe92614fb9016.jpg', '', '', 'Health & Beauty , Skin Care , Facial Cleansers,,', '<div style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span></span><span style=\"margin: 0.0px;padding: 0.0px;color: #000000;font-style: normal;font-variant: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: start;text-indent: 0.0px;text-transform: none;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: transparent;text-decoration: none;font-size: 12.0pt;font-family: arial;vertical-align: baseline;white-space: pre-wrap;\">Oily skin can be a bit more demanding and needs a little extra to get that glow going! While eating right and ensuring hydration is important, it is also essential to maintain a good skin care regimen. So, let\'s take our skin-care game up by a notch and pick the right anti acne face wash for keeping acne at bay while maintaining the rosy radiance.</span><span style=\"margin: 0.0px;padding: 0.0px;color: #000000;\"></span><p style=\"margin: 0;padding: 8.0px 0;font-size: 14.0px;color: #000000;\"><span style=\"margin: 0.0px;padding: 0.0px;font-size: 12.0pt;font-family: arial;color: #000000;background-color: transparent;font-weight: 400;font-style: normal;font-variant: normal;text-decoration: none;vertical-align: baseline;white-space: pre-wrap;\">Bella Vita Organic’s Anti Acne face wash is a pure natural ayurvedic blend that is a deeply hydrating and refreshing face wash for acne-prone skin. It is power-packed with natural herbs like aloe vera, neem, basil, and tea tree that nourish the skin and prevent acne. The anti-inflammatory properties of neem, the healing antioxidants of aloe vera, the cool & cleansing basil effect, and the gentle nourishment of tea tree give you soft & supple skin. The essence of neem fights the bacteria while the aloe vera soothes your skin and reduces sun damage. Good old basil cleanses the skin of dirt, pollutants & free radicals and tea tree oil helps reduce marks & inflammation caused by acne.</span></p><p style=\"margin: 0;padding: 8.0px 0;font-size: 14.0px;color: #000000;\"><span style=\"margin: 0.0px;padding: 0.0px;font-size: 12.0pt;font-family: arial;color: #000000;background-color: transparent;font-weight: 400;font-style: normal;font-variant: normal;text-decoration: none;vertical-align: baseline;white-space: pre-wrap;\">Perfectly suitable for both men & women, Bella Vita Organic’s Anti Acne Face Wash is one of the best face wash for oily & acne prone skin. It not only preserves your essential oils but also heals your skin naturally.</span></p></div>', '<ul>\n	<li>Controls and reduces acne and marks.</li>\n	<li>Brightens &amp; deep cleans face.</li>\n	<li>Reduces excess oil secretion on the face.</li>\n	<li>Detans face &amp; reduces sun damage.</li>\n	<li>Removes dirt, oil, pollutants, dust from pores.</li>\n	<li>Suitable for oily, combination and acne prone skin types.</li>\n</ul>_<div style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span></span><span style=\"margin: 0.0px;padding: 0.0px;color: #000000;font-style: normal;font-variant: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: start;text-indent: 0.0px;text-transform: none;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: transparent;text-decoration: none;font-size: 12.0pt;font-family: arial;vertical-align: baseline;white-space: pre-wrap;\">Oily skin can be a bit more demanding and needs a little extra to get that glow going! While eating right and ensuring hydration is important, it is also essential to maintain a good skin care regimen. So, let\'s take our skin-care game up by a notch and pick the right anti acne face wash for keeping acne at bay while maintaining the rosy radiance.</span><span style=\"margin: 0.0px;padding: 0.0px;color: #000000;\"></span><p style=\"margin: 0;padding: 8.0px 0;font-size: 14.0px;color: #000000;\"><span style=\"margin: 0.0px;padding: 0.0px;font-size: 12.0pt;font-family: arial;color: #000000;background-color: transparent;font-weight: 400;font-style: normal;font-variant: normal;text-decoration: none;vertical-align: baseline;white-space: pre-wrap;\">Bella Vita Organic’s Anti Acne face wash is a pure natural ayurvedic blend that is a deeply hydrating and refreshing face wash for acne-prone skin. It is power-packed with natural herbs like aloe vera, neem, basil, and tea tree that nourish the skin and prevent acne. The anti-inflammatory properties of neem, the healing antioxidants of aloe vera, the cool & cleansing basil effect, and the gentle nourishment of tea tree give you soft & supple skin. The essence of neem fights the bacteria while the aloe vera soothes your skin and reduces sun damage. Good old basil cleanses the skin of dirt, pollutants & free radicals and tea tree oil helps reduce marks & inflammation caused by acne.</span></p><p style=\"margin: 0;padding: 8.0px 0;font-size: 14.0px;color: #000000;\"><span style=\"margin: 0.0px;padding: 0.0px;font-size: 12.0pt;font-family: arial;color: #000000;background-color: transparent;font-weight: 400;font-style: normal;font-variant: normal;text-decoration: none;vertical-align: baseline;white-space: pre-wrap;\">Perfectly suitable for both men & women, Bella Vita Organic’s Anti Acne Face Wash is one of the best face wash for oily & acne prone skin. It not only preserves your essential oils but also heals your skin naturally.</span></p></div>', 480.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 1, 0, 2, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Bella Vita Organic Face Wash Antiacne 115g price in Nepal', '', NULL, NULL, 'bella-v