(373, 'Pixi Glow Mud Cleanser 135ml', 0, 0, NULL, 'seller', 261, 10, 76, 398, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/f4b0d2d0f241d968e2dab6ad3030e241.jpg\"]', 'https://static-01.daraz.com.np/p/f4b0d2d0f241d968e2dab6ad3030e241.jpg', 'https://static-01.daraz.com.np/p/f4b0d2d0f241d968e2dab6ad3030e241.jpg', 'https://static-01.daraz.com.np/p/f4b0d2d0f241d968e2dab6ad3030e241.jpg', '', '', 'Health & Beauty , Skin Care , Facial Cleansers,,', '<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span>You simply massage this on to dry skin (I avoid the eye area) then rinse off. If I have been wearing makeup, I use it after a cleansing balm or oil. It works very well after the new Pixi Nourishing Cleansing Balm which is ultra luxurious.</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span>ThePixi Glow Mud Cleanser rinses away really easily and leaves super clean, soft and glowing skin. You can follow with Pixi Glow Tonic, which I have been doing, and the glow grows. It’s a wonderful duo. I have been using this combo a few times a week and feel that’s enough.</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span></span></p>', '<ul>\n	<li>A deep pore cleansing mud, enriched with 5% Glycolic and soothing botanicals.<br />\n	&bull; Formulated to provide effective cleansing, yet is mild enough for all skin.<br />\n	&bull; Complexion is cleansed and gently exfoliated to reveal radiant and healthy skin.<br />\n	&bull; Deep pore cleansing leaving skin clean and glowing.<br />\n	&bull; Gently exfoliates and revitalises.<br />\n	&bull; Suitable for all skin types<br />\n	&bull; Paraben-free<br />\n	&bull; Not tested on animals<br />\n	&bull; Volume: 135 ml / 4.57 fl oz</li>\n</ul>_<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span>You simply massage this on to dry skin (I avoid the eye area) then rinse off. If I have been wearing makeup, I use it after a cleansing balm or oil. It works very well after the new Pixi Nourishing Cleansing Balm which is ultra luxurious.</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span>ThePixi Glow Mud Cleanser rinses away really easily and leaves super clean, soft and glowing skin. You can follow with Pixi Glow Tonic, which I have been doing, and the glow grows. It’s a wonderful duo. I have been using this combo a few times a week and feel that’s enough.</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span></span></p>', 2900.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 1, 0, 6, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Pixi Glow Mud Cleanser 135ml price in Nepal', '', NULL, NULL, 'pixi-glow-mud-cleanser-135ml12758', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:26:57', '2022-06-09 22:26:57'),
