(376, 'The Body Shop-Oils of Life Oil in Gel Cleanser 100ml', 0, 0, NULL, 'seller', 261, 10, 76, 398, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/d5ff3b315e729166026728290086ee7f.png\"]', 'https://static-01.daraz.com.np/p/d5ff3b315e729166026728290086ee7f.png', 'https://static-01.daraz.com.np/p/d5ff3b315e729166026728290086ee7f.png', 'https://static-01.daraz.com.np/p/d5ff3b315e729166026728290086ee7f.png', '', '', 'Health & Beauty , Skin Care , Facial Cleansers,,', '<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"font-family: none;\"></span><span>On a daily basis I wear thick heavy make- up. Aside from looking flawless all day, taking the whole lot off at the end of the day is a chore. That has all changed thanks to the</span><span></span><a style=\"box-sizing: border-box;background: transparent;text-decoration: none;color: #dd3333;transition: color 0.2s linear 0.0s;\"><span>Oils of Life Intensely Revitalising Cleansing Oil in Gel.A careful blend of 3 seed oils, the thick gel formula contains over 30% of pure oil which is said to leave your skin feeling smoother, appear more radiant and moisturised for up to 72hrs. Is that a bold claim or can the Oils of Life Intensely Revitalising Cleansing Oil in Gel deliver? Read on…..For years I was obsessed with the Elemis oil in gel cleanser.that was a heavy duty gem but after it was discontinued I struggled to find a suitable replacement. Not keen on digging my nails in to pots of balm that need to be warmed in the hand before applying, I was resorting to removing all my make up with a couple of wipes before going in with a more gentle double cleanse. Very time consuming, yes?</span></a></p><p style=\"box-sizing: border-box;color: #000000;font-family: arial;font-size: 15.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: justify;text-indent: 0.0px;text-transform: none;white-space: pre-wrap;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;margin: 0;padding: 8.0px 0;\"><span>The Oils of Life Intensely Revitalising Cleansing Oil in Gel is a thick viscous gel that is easily massaged in across the skin without any drag. I massage across the areas of my skin that get most congested before lightly sweeping over my eyes.There is no stinging at all and removes even the heaviest of goth black eyeliners – trust me! I splash warm water on to my skin to emulsify the cleanser before wiping the whole lot off with a fresh wet flannel.</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span></span></p>', '<ul>\n	<li>Strengthens the skin barrier to trap moisture and hydrate the skin.</li>\n	<li>Supports soft and supple skin.</li>\n	<li>Evens skin complexion.</li>\n	<li>Regulates natural sebum (oil) production.</li>\n	<li>Reduces acne breakouts and blemishes (anti-inflammatory properties)</li>\n	<li>Cleanses the skin (antibacterial properties)</li>\n</ul>_<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"font-family: none;\"></span><span>On a daily basis I wear thick heavy make- up. Aside from looking flawless all day, taking the whole lot off at the end of the day is a chore. That has all changed thanks to the</span><span></span><a style=\"box-sizing: border-box;background: transparent;text-decoration: none;color: #dd3333;transition: color 0.2s linear 0.0s;\"><span>Oils of Life Intensely Revitalising Cleansing Oil in Gel.A careful blend of 3 seed oils, the thick gel formula contains over 30% of pure oil which is said to leave your skin feeling smoother, appear more radiant and moisturised for up to 72hrs. Is that a bold claim or can the Oils of Life Intensely Revitalising Cleansing Oil in Gel deliver? Read on…..For years I was obsessed with the Elemis oil in gel cleanser.that was a heavy duty gem but after it was discontinued I struggled to find a suitable replacement. Not keen on digging my nails in to pots of balm that need to be warmed in the hand before applying, I was resorting to removing all my make up with a couple of wipes before going in with a more gentle double cleanse. Very time consuming, yes?</span></a></p><p style=\"box-sizing: border-box;color: #000000;font-family: arial;font-size: 15.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: justify;text-indent: 0.0px;text-transform: none;white-space: pre-wrap;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;margin: 0;padding: 8.0px 0;\"><span>The Oils of Life Intensely Revitalising Cleansing Oil in Gel is a thick viscous gel that is easily massaged in across the skin without any drag. I massage across the areas of my skin that get most congested before lightly sweeping over my eyes.There is no stinging at all and removes even the heaviest of goth black eyeliners – trust me! I splash warm water on to my skin to emulsify the cleanser before wiping the whole lot off with a fresh wet flannel.</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span></span></p>', 3490.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 0, 0, 2, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'The Body Shop-Oils of Life Oil in Gel Cleanser 100ml price in Nepal', '', NULL, NULL, 'the-body-shop-oils-of-life-oil-in-gel-cleanser-100ml12761', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:26:57', '2022-06-09 22:26:57'),
