(381, 'The Body Shop- Lemon Purifying Face Wash 125ml', 0, 0, NULL, 'seller', 261, 10, 76, 398, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/f9e33c9603c0f8260b3c07007747d498.jpg\"]', 'https://static-01.daraz.com.np/p/f9e33c9603c0f8260b3c07007747d498.jpg', 'https://static-01.daraz.com.np/p/f9e33c9603c0f8260b3c07007747d498.jpg', 'https://static-01.daraz.com.np/p/f9e33c9603c0f8260b3c07007747d498.jpg', '', '', 'Health & Beauty , Skin Care , Facial Cleansers,,', '<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span>Start and end your day with Lemon Purifying Face Wash.Squirt a dollop of Lemon Purifying Face Wash into your palms and massage onto damp skin to intensely cleanse your complexion.Take in that gentle citrus scent.Rinse with cool water and feel instantly refreshed.This gentle yet purifying Face Wash helps wash away bacteria and impurities and is enriched with natural lemon essential oil.It’s the perfect ritual to start and end your day feeling squeaky clean.</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span></span></p>', '<ul>\n	<li>Helps wash away impurities</li>\n	<li>For every-day use</li>\n	<li>With natural lemon essential oil extracted from lemon peels, known for its purifying properties</li>\n	<li>With Community Fair Trade Organic Aloe Vera from Mexico, known for its soothing properties.</li>\n	<li>Helps wash away bacteria and impurities For every-day use With natural lemon essential oil extracted from lemon peels, known for its purifying properties</li>\n	<li>With Community Fair Trade Organic Aloe Vera from Mexico, known for its soothing properties. Vegan</li>\n</ul>_<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span>Start and end your day with Lemon Purifying Face Wash.Squirt a dollop of Lemon Purifying Face Wash into your palms and massage onto damp skin to intensely cleanse your complexion.Take in that gentle citrus scent.Rinse with cool water and feel instantly refreshed.This gent