(402, 'Loreal Paris 2In1 XFiber False Lash Macsara 9ml', 0, 0, NULL, 'seller', 261, 10, 71, 362, 585, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/dc25937637255d6658995fec1785cad3.png\"]', 'https://static-01.daraz.com.np/p/dc25937637255d6658995fec1785cad3.png', 'https://static-01.daraz.com.np/p/dc25937637255d6658995fec1785cad3.png', 'https://static-01.daraz.com.np/p/dc25937637255d6658995fec1785cad3.png', '', '', 'Health & Beauty , Makeup , Eyes , Mascaras,', '<div style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span></span><div style=\"margin: 0;padding: 8.0px 0;word-break: break-word;height: auto;line-height: 19.0px;overflow-y: hidden;border-bottom: 1.0px solid #eff0f5;color: #000000;\"><p style=\"margin: 0;padding: 8.0px 0;font-size: 14.0px;white-space: pre-wrap;\"><span style=\"margin: 0.0px;padding: 0.0px;color: #000000;font-family: none;font-size: 12.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: start;text-indent: 0.0px;text-transform: none;white-space: normal;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;display: inline;float: none;\">Start by applying the black primer making sure to coat every lash. Then, before the primer dries apply the fiber-rich mascara on top of the primed lashes to create an extreme lash fringe effect. Repeat on other eye. Removes easily with soap and water. Precautions: To safeguard L\'Oreal Purity, reserve this product for your personal use. Treat the applicator with the hygienic care you give your eyes. Never apply this product in a moving vehicle. Do not dilute mascara with water, saliva, or any other substance. Cap tightly after use. If change in odor or appearance occurs, discontinue use. Do not use this or any other eye cosmetic if your eye is injured, irritated, or infected. Consult a physician promptly.</span></p></div><div style=\"margin: 0;padding: 8.0px 0;border-bottom: 1.0px solid #eff0f5;font-size: 14.0px;color: #000000;\"><h2 style=\"margin: 0.0px;padding: 0.0px;font-weight: 500;font-family: roboto-medium;font-size: 16.0px;line-height: 19.0px;color: #212121;letter-spacing: 0.0px;overflow: hidden;text-overflow: ellipsis;white-space: nowrap;\"><span>Specifications of L\'Oréal Paris Voluminous X Fiber Mascara- 9ml / Loreal Mascara Volume</span></h2></div></div>', '<ul>\n	<li>No Falsies. No Extensions. Just Fibers. L&#39;Oreal&#39;s Voluminous X Fiber Mascara is both a volumizing mascara and a lengthening mascara.</li>\n	<li>This two-step mascara system creates extreme volume and length for an extreme lash fringe effect.</li>\n	<li>First, prime lashes with black primer to instantly build intense volume and color on each lash.</li>\n	<li>Next, apply fiber-infused mascara for up to 7X more volume.</li>\n	<li>Black primer and fiber mascara system for extreme lash fringe look Black primer instantly builds intense volume and color Fiber-infused mascara for up to 7X more volume Smudge-resistant mascara</li>\n</ul>_<div style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span></span><div style=\"margin: 0;padding: 8.0px 0;word-break: break-word;height: auto;line-height: 19.0px;overflow-y: hidden;border-bottom: 1.0px solid #eff0f5;color: #000000;\"><p style=\"margin: 0;padding: 8.0px 0;font-size: 14.0px;white-space: pre-wrap;\"><span style=\"margin: 0.0px;padding: 0.0px;color: #000000;font-family: none;font-size: 12.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: start;text-indent: 0.0px;text-transform: none;white-space: normal;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;display: inline;float: none;\">Start by applying the black primer making sure to coat every lash. Then, before the primer dries apply the fiber-rich mascara on top of the primed lashes to create an extreme lash fringe effect. Repeat on other eye. Removes easily with soap and water. Precautions: To safeguard L\'Oreal Purity, reserve this product for your personal use. Treat the applicator with the hygienic care you give your eyes. Never apply this product in a moving vehicle. Do not dilute mascara with water, saliva, or any other substance. Cap tightly after use. If change in odor or appearance occurs, discontinue use. Do not use this or any other eye cosmetic if your eye is injured, irritated, or infected. Consult a physician promptly.</span></p></div><div style=\"margin: 0;padding: 8.0px 0;border-bottom: 1.0px solid #eff0f5;font-size: 14.0px;color: #000000;\"><h2 style=\"margin: 0.0px;padding: 0.0px;font-weight: 500;font-family: roboto-medium;font-size: 16.0px;line-height: 19.0px;color: #212121;letter-spacing: 0.0px;overflow: hidden;text-overflow: ellipsis;white-space: nowrap;\"><span>Specifications of L\'Oréal Paris Voluminous X Fiber Mascara- 9ml / Loreal Mascara Volume</span></h2></div></div>', 1995.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 1, 0, 3, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Loreal Paris 2In1 XFiber False Lash Macsara 9ml price in Nepal', '', NULL, NULL, 'loreal-paris-2in1-xfiber-false-lash-macsara-9ml12787', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:26:58', '2022-06-09 22:26:58'),
(403, 'Maybelline Lash Sensational Multiplying Mascara Black 9.5ml', 0, 0, NULL, 'seller', 261, 10, 71, 362, 585, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/4c5b3364375de850013c96451aa20330.jpg\"]', 'https://static-01.daraz.com.np/p/4c5b3364375de850013c96451aa20330.jpg', 'https://static-01.daraz.com.np/p/4c5b3364375de850013c96451aa20330.jpg', 'https://static-01.daraz.com.np/p/4c5b3364375de850013c96451aa20330.jpg', '', '', 'Health & Beauty , Makeup , Eyes , Mascaras,', '<div style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"color: #777777;\">The Lash Sensational Mascara desifyies your lashes to give you 3X more volume. With the first caring serum with an eye catcher brush, the masacara creates natural, sensational lashes and is a must for that perfect eye make up.</span></div>', '<ul>\n	<li>Lash Sensational Washable mascara unfolds layers of lashes for a sensational full fan effect</li>\n	<li>Its exclusive fanning brush with ten layers of bristles.</li>\n	<li>This cult-favorite mascara delivers supple, separated lashes that never feel weighed down.</li>\n	<li>The New Midnight Black shade; infused with Rose Hip Oil to condition the lashes for an even softer feel.</li>\n	<li>The look of length and volume without clumping.</li>\n	<li>The fresh liquid formula captures lashes from root to tip for fanned-out volume.</li>\n	<li>Ophthalmologist tested. Suitable for contact lens wearers</li>\n</ul>\n\n<p>.</p>_<div style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"color: #777777;\">The Lash Sensational Mascara desifyies your lashes to give you 3X more volume. With the first caring serum with an eye catcher brush, the masacara creates natural, sensational lashes and is a must for that perfect eye make up.</span></div>', 1290.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 1, 0, 12, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Maybelline Lash Sensational Multiplying Mascara Black 9.5ml price in Nepal', '', NULL, NULL, 'maybe