(404, 'Maybelline The Colossal 7X Volume Mascara Yellow 10ml', 0, 0, NULL, 'seller', 261, 10, 71, 362, 585, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/e1d6e77c06fe0faaf3747e4ce7ba1f13.jpg\"]', 'https://static-01.daraz.com.np/p/e1d6e77c06fe0faaf3747e4ce7ba1f13.jpg', 'https://static-01.daraz.com.np/p/e1d6e77c06fe0faaf3747e4ce7ba1f13.jpg', 'https://static-01.daraz.com.np/p/e1d6e77c06fe0faaf3747e4ce7ba1f13.jpg', '', '', 'Health & Beauty , Makeup , Eyes , Mascaras,', '<div></div>', '<ul>\n	<li>\n	<p>Volum&#39; Express Colossal. 7x the volume instantly.</p>\n	</li>\n	<li>\n	<p>No clumps. With mega brush. With collagen. Mega brush zooms on 7x the volume instantly, without clumps.</p>\n	</li>\n	<li>\n	<p>Volume-plumping formula contains collagen. Ophthalmologist tested. Contact lens safe.</p>\n	</li>\n	<li>\n	<p><strong>Directions:&nbsp;</strong>For best results, apply mascara by sweeping brush from root to tip. Do not let dry between coats.</p>\n	</li>\n	<li>\n	<p>Removes easily&nbsp;</p>\n	</li>\n</ul>_<div></div>', 1245.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 0, 0, 12, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Maybelline The Colossal 7X Volume Mascara Yellow 10ml price in Nepal', '', NULL, NULL, 'maybelline-the-colossal-7x-volume-mascara-yellow-10ml12789', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:26:58', '2022-06-09 22:26:58'),
(405, 'L\'Oreal Paris Mega Volume Collagene 24H Mascara - Extra Black 9ml', 0, 0, NULL, 'seller', 261, 10, 71, 362, 585, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/47cc63ebddf48c574f49d8361ce62840.jpg\"]', 'https://static-01.daraz.com.np/p/47cc63ebddf48c574f49d8361ce62840.jpg', 'https://static-01.daraz.com.np/p/47cc63ebddf48c574f49d8361ce62840.jpg', 'https://static-01.daraz.com.np/p/47cc63ebddf48c574f49d8361ce62840.jpg', '', '', 'Health & Beauty , Makeup , Eyes , Mascaras,', '<div style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><strong style=\"margin: 0.0px;padding: 0.0px;font-weight: 700;\">L\'Oréal Paris Mega Volume Collagene 24h Black Mascarais an eyelash mascara that intensifies the volume of your lashes for 24h. Its formula enriched with collagen has an enormous water-binding ability, preventing water loss, thus being a strong humectant so your eyelashes do not dry out with the mascara. Additionally, the carnauba wax in its composition thickens the lashes without weighing down. Also, the iron oxide black present is an inorganic pigment that provides an intense black result.</strong></div>', '<ul>\n	<li>Collagen has an enormous water-binding ability, preventing water loss, thus being a strong humectant so your eyelashes do not dry out with the mascara;</li>\n	<li>Carnauba wax thickens the lashes without weighing down;</li>\n	<li>Iron Oxide Black is an inorganic pigment that provides an intense black result.</li>\n</ul>_<div style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><strong style=\"margin: 0.0px;padding: 0.0px;font-weight: 700;\">L\'Oréal Paris Mega Volume Collagene 24h Black Mascarais an eyelash mascara that intensifies the volume of your lashes for 24h. Its formula enriched with collagen has an enormous water-binding ability, preventing water loss, thus being a strong humectant so your eyelashes do not dry out with the mascara. Additionally, the carnauba wax in its composition thickens the lashes without weighing down. Also, the iron oxide black present is an inorganic pigment that provides an intense black result.</strong></div>', 1995.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 1, 0, 3, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'L\'Oreal Paris Mega Volume Collagene 24H Mascara - Extra Black 9ml price in Nepal', '', NULL, NULL, 'l-oreal-paris-mega-volume-collagene-24h-mascara-extra-black-9ml12790', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:26:58', '2022-06-09 22:26:58'),
