almologist tested and is safe for contact lens wearers.</span></div>', 1290.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 1, 0, 6, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Maybelline 9X Volume 231 The Colossal Mascara 9.2ml price in Nepal', '', NULL, NULL, 'maybelline-9x-volume-231-the-colossal-mascara-9-2ml12792', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:26:58', '2022-06-09 22:26:58'),
