 also soothes dryness associated with sunburn. It’s light, fast absorbing and non-greasy formula leaves your skin feeling clean and fresh. Apply daily to restore moisture and relieve dryness without any greasiness.</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span></span></p>', '<ul>\n	<li>Intensive care</li>\n	<li>With pure aloe</li>\n	<li>48 hours of moisturisation</li>\n	<li>Instantly soothes &amp; hydrates</li>\n	<li>Normal to dry skin</li>\n</ul>_<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"color: #3a3a3a;font-family: tajawal , sans-serif;font-size: 16.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: start;text-indent: 0.0px;text-transform: none;white-space: normal;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;display: inline;float: none;\">Made with Aloe-Vera, a special blend of Vaseline Jelly and humectants, Aloe Soothe helps keep your skin looking healthy and fresh. Containing aloe, which is well-known for its soothing properties, this body lotion is perfect for dry, itchy skin. Our Intensive Care range works to heal dry skin, deep down. Unlike basic moisturizing that just sits on the skin’s surface, Vaseline Intensive Care Aloe Soothe Body Lotion deeply moisturizes using glycerine, which draws moisture to the skin, and healing micro-droplets of Vaseline Jelly that lock in moisture. With daily exposure to environmental conditions (like wind, lack of humidity and sun) your skin’s natural moisture barrier can break down, allowing for water to escape. The healing micro-droplets of Vaseline Jelly in our lotion locks in moisture to allow the skin’s natural barrier to recover. Providing a sensational moisturizing experience, this lotion is the ideal solution for relieving ev