(451, 'Pixi Glow Tonic 250ml', 0, 0, NULL, 'seller', 261, 10, 76, 403, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/1adf632b3b536d64bb90d535304ecfaa.png\"]', 'https://static-01.daraz.com.np/p/1adf632b3b536d64bb90d535304ecfaa.png', 'https://static-01.daraz.com.np/p/1adf632b3b536d64bb90d535304ecfaa.png', 'https://static-01.daraz.com.np/p/1adf632b3b536d64bb90d535304ecfaa.png', '', '', 'Health & Beauty , Skin Care , Toner & Mists,,', '<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"color: #666666;font-family: none;font-size: 12.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: start;text-indent: 0.0px;text-transform: none;white-space: normal;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;display: inline;float: none;\"></span></p>', '<ul>\n	<li>\n	<p>Exfoliating facial Glow Tonic&trade;. It helps tone, firm and tighten the skin. It removes dead skin cells for healthier looking skin.</p>\n	</li>\n	<li>\n	<p>Gently accelerates cell renewal to reveal a brighter, glowing complexion. Balances, heals and soothes for radiant, healthier looking skin.</p>\n	</li>\n	<li>Alcohol free</li>\n	<li>Suitable for all skin types</li>\n	<li>Volume: 250ml</li>\n</ul>_<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"color: #666666;font-family: none;font-size: 12.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: start;text-indent: 0.0px;text-transform: none;white-space: normal;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;display: inline;float: none;\"></span></p>', 4500.