(452, 'Pixi Retinol Tonic 100ml', 0, 0, NULL, 'seller', 261, 10, 76, 403, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/50fddff98d7b41a6d6eaad1c6354781d.jpg\"]', 'https://static-01.daraz.com.np/p/50fddff98d7b41a6d6eaad1c6354781d.jpg', 'https://static-01.daraz.com.np/p/50fddff98d7b41a6d6eaad1c6354781d.jpg', 'https://static-01.daraz.com.np/p/50fddff98d7b41a6d6eaad1c6354781d.jpg', '', '', 'Health & Beauty , Skin Care , Toner & Mists,,', '<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span>Smooth and firm your facial contours with PIXI Retinol Tonic, a weightless toner that helps to create a radiant complexion. Enriched with Jasmine Flower to soothe sensitive skin, the treatment absorbs instantly to deliver a rich combination of antioxidants and peptides, which work to plump and lift skin while protecting against environmental aggressors. Time-release Retinol minimises the appearance of fine lines and wrinkles for an anti-ageing effect. After use, skin feels soft and supple and is infused with a luminous glow.</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span>We love that Retinol Tonic brightens and tones the skin to reveal a brighter, more youthfullooking complexion. The cruelty-free formula includes Jasmine Flower to heal and balance and Retinol to renew and firm but does not irritate the skin like other retinol products sometimes can. Potent antioxidants replenish the skin for a smoother, softer appearance, and retinol rejuvenates the skin for a natural glow. It\'s ideal for mature skin that may be showing the first signs of ageing, as well as skin that is prone to breakouts or those suffering from acne.</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span>Founded by Petra Strand, who has over 20 years of experience as a makeup artist & product developer, PIXI opened its flagship store in Soho, London. PIXI creates skincare and makeup which enhance your natural beauty. Infused with botanicals and skin-loving ingredients, many of the brand’s innovative formulations have become cult products which can be found in almost every beauty collection. It has established a loyal worldwide following thanks to its skin-loving products that create a naturally radiant appearance.</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span>Use Retinol Tonic daily after cleansing in the PM and apply with a cotton pad all over your complexion. There\'s no need to rinse and remember to apply an SPF the following morning when using Retinol Tonic. It\'s essential to use sun protection when your skincare routine includes products that contain Retinol.</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span></span></p>', '<ul>\n	<li>&quot;This potent youth preserving tonic features a unique time-release Retinol to help rejuvenate the skin for a natural glow. Powerful antioxidants and botanicals replenish the skin for a smoother, softer appearance while soothing sensitive skin.</li>\n	<li>This multi-action treatment with time release Retinol also replenishes skin with potent antioxidants.</li>\n	<li>Time-release Retinol reduces fine lines &amp; smoothes complexion.</li>\n	<li>Peptides firm skin &amp; boost collagen production</li>\n	<li>Jasmine Flower heals &amp; balances</li>\n	<li>Alcohol-free</li>\n	<li>Suitable for all skin types</li>\n	<li>Paraben Free</li>\n</ul>\n\n<p>&nbsp;</p>_<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span>Smooth and firm your facial contours with PIXI Retinol Tonic, a weightless toner that helps to create a radiant complexion. Enriched with Jasmine Flower to soothe sensitive skin, the treatment absorbs instantly to deliver a rich combination of antioxidants and peptides, which work to plump and lift skin while protecting against environmental aggressors. Time-release Retinol minimises the appearance of fine lines and wrinkles for an anti-ageing effect. After use, skin feels soft and supple and is infused with a luminous glow.</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span>We love that Retinol Tonic brightens and tones the skin to reveal a brighter, more youthfullooking complexion. The cruelty-free formula includes Jasmine Flower to heal and balance and Retinol to renew and firm but does not irritate the skin like other retinol products sometimes can. Potent antioxidants replenish the skin for a smoother, softer appearance, and retinol rejuvenates the skin for a natural glow. It\'s ideal for mature skin that may be showing the first signs of ageing, as well as skin that is prone to breakouts or those suffering from acne.</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span>Founded by Petra Strand, who has over 20 years of experience as a makeup artist & product developer, PIXI opened its flagship store in Soho, London. PIXI creates skincare and makeup which enhance your natural beauty. Infused with botanicals and skin-loving ingredients, many of the brand’s innovative formulations have become cult products which can be found in almost every beauty collection. It has established a loyal worldwide following thanks to its skin-loving products that create a naturally radiant appearance.</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span>Use Retinol Tonic daily after cleansing in the PM and apply with a cotton pad all over your complexion. There\'s no need to rinse and remember to apply an SPF the following morning when using Retinol Tonic. It\'s essential to use sun protection when your skincare routine includes products that contain Retinol.</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span></span></p>', 2450.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 1, 0, 5, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Pixi Retinol Tonic 100ml price in Nepal', '', NULL, NULL, 'pixi-retinol-tonic-100ml12837', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:26:59', '2022-06-09 22:26:59');
