(453, 'Peachytonics Balance Toning Mist 100ml', 0, 0, NULL, 'seller', 261, 10, 76, 403, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/788abb23d800a4ca95f1252ff0fd7126.jpg\"]', 'https://static-01.daraz.com.np/p/788abb23d800a4ca95f1252ff0fd7126.jpg', 'https://static-01.daraz.com.np/p/788abb23d800a4ca95f1252ff0fd7126.jpg', 'https://static-01.daraz.com.np/p/788abb23d800a4ca95f1252ff0fd7126.jpg', '', '', 'Health & Beauty , Skin Care , Toner & Mists,,', '<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span>*Please always use sunscreen while using any products that contain AHA’s/BHA’s since these ingredients may cause increased skin sensitivity to sunlight.</span></p><p style=\"-webkit-font-smoothing: antialiased;box-sizing: border-box;margin-top: 0.0px;font-size: 14.0px;font-weight: 400;margin-bottom: 1.6em;color: #454545;font-family: futura , sans-serif;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;letter-spacing: normal;orphans: 2;text-align: left;text-indent: 0.0px;text-transform: none;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;white-space: pre-wrap;margin: 0;padding: 8.0px 0;\"><span>To Use: Mist over cleansed skin. Follow with serum or moisturizer of choice.Use throughout the day whenever skin needs a glowing boost of hydration.</span></p><p style=\"-webkit-font-smoothing: antialiased;box-sizing: border-box;margin-top: 0.0px;font-size: 14.0px;font-weight: 400;margin-bottom: 1.6em;color: #454545;font-family: futura , sans-serif;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;letter-spacing: normal;orphans: 2;text-align: left;text-indent: 0.0px;text-transform: none;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;