(486, 'Urban Botanics Kalonji Cold Pressed(Black Seed) Oil 200ml', 0, 0, NULL, 'seller', 261, 10, 70, 357, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/ae1aeb70547da820ed742cfe888b0594.png\"]', 'https://static-01.daraz.com.np/p/ae1aeb70547da820ed742cfe888b0594.png', 'https://static-01.daraz.com.np/p/ae1aeb70547da820ed742cfe888b0594.png', 'https://static-01.daraz.com.np/p/ae1aeb70547da820ed742cfe888b0594.png', '', '', 'Health & Beauty , Hair Care , Hair Oil,,', '<div style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"color: #0f1111;\">Kalonji oil is full of vital nutrients and vitamins which works great for hair and skin. It can be applied on acne and scars to maintain the natural shine of skin. It helps controlling hair fall and retains the moisture of your hair.</span></div>', '<ul>\n	<li>100% Pure Premium Cold Pressed Extra Virgin Kalonji Oil</li>\n	<li>Black Seed Oil is a natural source of Essential Fatty Acids</li>\n	<li>Promotes Healthy Skin &amp; Hair</li>\n	<li>Anti-inflammatory properties</li>\n	<li>Retains shine and moisture of skin</li>\n	<li>Moisturizes scalp and strengthens hair</li>\n	<li>Carefully harvested and extracted by a cold press method</li>\n	<li>Shelf life - 24 months</li>\n</ul>_<div style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"color: #0f1111;\">Kalonji oil is full of vital nutrients and vitamins which works great for hair and skin. It can be applied on acne and scars to maintain the natural shine of skin. It helps controlling hair fall and retains the moisture of your hair.</span></div>', 1250.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 1, 0, 2, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Urban Botanics Kalonji Cold Pressed(Black Seed) Oil 200ml price in Nepal', '', NULL, NULL, 'urban-botanics-kalonji-cold-pressed-black-seed-oil-200ml12871', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:26:59', '2022-06-09 22:26:59'),
(487, 'Nature\'s Tattva Black Castor Hair Oil 100ml', 0, 0, NULL, 'seller', 261, 10, 70, 357, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/1f91e983b20b1322055c8103e472c4be.jpg\"]', 'https://static-01.daraz.com.np/p/1f91e983b20b1322055c8103e472c4be.jpg', 'https://static-01.daraz.com.np/p/1f91e983b20b1322055c8103e472c4be.jpg', 'https://static-01.daraz.com.np/p/1f91e983b20b1322055c8103e472c4be.jpg', '', '', 'Health & Beauty , Hair Care , Hair Oil,,', '<div style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"color: #272727;font-family: poppins , sans-serif;font-size: 14.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: left;text-indent: 0.0px;text-transform: none;white-space: normal;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;display: inline;float: none;\">Nature’s Tattva Jamaican Black Castor Oil has been extracted from black castor seeds procured from Jamaica. Jamaican Black Castor Oil is extracted by cold pressing roasted castor beans instead of the raw castor beans. Since the castor beans are roasted before the oil is extracted, it gives a dark blackish colour to the oil as compared with castor oil which is extracted from unroasted beans.</span></div>', '<ul>\n	<li>Pure and natural Jamaican black castor oil:&nbsp;Cold pressed, 100 percent natural and vegan castor carrier oil extracted from roasted castor beans from Jamaica - Sustainably sourced, non-gmo and free from chemicals and preservatives</li>\n	<li>Moisturising properties for hair:&nbsp;This thick oil offers rich moisture to dry hair, making it less prone to damage and brittleness. Over time it can improve the thickness, health and shine of the hair too.</li>\n	<li>Manages scalp troubles:&nbsp;Black castor oil may help address issues like dandruff, irritation, dryness and itchiness on the scalp. This oil also supplies valuable nutrition to the hair follicles resulting in stronger roots.</li>\n	<li>Improves hair growth:&nbsp;This oil is linked to improved hair growth. It is often recommended as a way to promote the growth, strength and thickness of the hair. It improves blood flow to the scalp which in turn stimulates hair growth.</li>\n	<li>Versatile, multipurpose oil:&nbsp;Along with multiple benefits for the hair, black castor oil may also be used to promote eyelash and eyebrow growth. This versatile oil offers many different uses.</li>\n	<li>Suitable for all hair types:&nbsp;Jamaican black castor oil is suitable for all hair types, but it is particularly beneficial for dry, curly, coily hair. Those with finer, less dry hair textures can dilute black castor oil with virgin olive oil to make it easier to wash out.</li>\n</ul>_<div style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"color: #272727;font-family: poppins , sans-serif;font-size: 14.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: left;text-indent: 0.0px;text-transform: none;white-space: normal;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;display: inline;float: none;\">Nature’s Tattva Jamaican Black Castor Oil has been extracted from black castor seeds procured from Jamaica. Jamaican Black Castor Oil is extracted by cold pressing roasted castor beans instead of the raw castor beans. Since the castor beans are roasted before the oil is extracted, it gives a dark blackish colour to the oil as compared with castor oil which is extracted from unroasted beans.</span></div>', 1050.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 0, 0, 1, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Nature\'s Tattva Black Castor Hair Oil 100ml price in Nepal', '', NULL, NULL, 'nature-s-tattva-black-castor-hair-oil-100ml12872', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:26:59', '2022-06-09 22:26:59'),
(488, 'Juicy Chemistry Chilli,Horsetail&Black Seed Hair Oil 30ml', 0, 0, NULL, 'seller', 261, 10, 70, 357, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/b7f671a361942bae914a8f73f1a870d7.jpg\"]', 'https://static-01.daraz.com.np/p/b7f671a361942bae914a8f73f1a870d7.jpg', 'https://static-01.daraz.com.np/p/b7f671a361942bae914a8f73f1a870d7.jpg', 'https://static-01.daraz.com.np/p/b7f671a361942bae914a8f73f1a870d7.jpg', '', '', 'Health & Beauty , Hair Care , Hair Oil,,', '<div style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"color: #272727;font-family: poppins , sans-serif;font-size: 14.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: left;text-indent: 0.0px;text-transform: none;white-space: normal;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;display: inline;float: none;\">Juicy Chemistry Organic Hair Oil for Hair Growth and Hair Fall Control with Chilli, Horsetail and Black Seed , formulated with exclusive ingredients, this nourishing hair oil not just promises hair growth, but also helps to control hair fall, slows down ageing of the scalp, and promises long lustrous locks.</span></div>', '<ul>\n	<li>Powerful ingredients such as black seed, horsetail and chilli stimulate the scalp, improve blood circulation and promote hair growth.</li>\n	<li>Horsetail is rich in minerals and prevents hair-thinning and tackles scalp irritation.</li>\n	<li>Black seed oil&rsquo;s anti-inflammatory and antifungal properties help maintain a healthy scalp.</li>\n	<li>The black seed oil also contains potent and nourishing antihistamines that help with hair regrowth and curb hair-fall.</li>\n</ul>_<div style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"color: #272727;font-family: poppins , sans-serif;font-size: 14.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: left;text-indent: 0.0px;text-transform: none;white-space: normal;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;display: inline;float: none;\">Juicy Chemistry Organic Hair Oil for Hair Growth and Hair Fall Control with Chilli, Horsetail and Black Seed , formulated with exclusive ingredients, this nourishing hair oil not just promises hair growth, but also helps to control hair fall, slows down ageing of the scalp, and promises long lustrous locks.</span></div>', 1850.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 1, 0, 2, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Juicy Chemistry Chilli,Horsetail&Black Seed Hair Oil 30ml price in Nepal', '', NULL, NULL, 'juicy-chemistry-chilli-horsetail-black-seed-hair-oil-30ml12873', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:26:59', '2022-06-09 22:26:59');
