(489, 'The Men Company beard oil 30ml', 0, 0, NULL, 'seller', 261, 10, 70, 357, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/d876fc1ce4205edb49dd913c2c0ebaa2.jpg\"]', 'https://static-01.daraz.com.np/p/d876fc1ce4205edb49dd913c2c0ebaa2.jpg', 'https://static-01.daraz.com.np/p/d876fc1ce4205edb49dd913c2c0ebaa2.jpg', 'https://static-01.daraz.com.np/p/d876fc1ce4205edb49dd913c2c0ebaa2.jpg', '', '', 'Health & Beauty , Hair Care , Hair Oil,,', '<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"box-sizing: border-box;color: #0f1111;\">Beard Growth Oil: Beard oil is one of the most important products for any man who wants to flaunt a bearded look. The Man Company brings an advanced almond & thyme beard oil for men. It promotes beard growth by supplying all the natural nutrients and makes it more manageable.</span></p><ul style=\"box-sizing: border-box;margin: 0.0px 0.0px 0.0px 18.0px;color: #0f1111;padding: 0.0px;\"><li style=\"box-sizing: border-box;list-style: disc;overflow-wrap: break-word;margin: 0.0px;\"><span style=\"box-sizing: border-box;color: #0f1111;\">Almond Oil: It is rich in Vitamin E and Protein, both of which have the proven benefits of promoting hair growth. The fatty acids in Almonds help in reducing inflammation of the skin under the beard.</span></li><li style=\"box-sizing: border-box;list-style: disc;overflow-wrap: break-word;margin: 0.0px;\"><span style=\"box-sizing: border-box;color: #0f1111;\">Thyme: Thyme is one of the essential ingredients of beard oil and promotes hair nourishment. It contains Vitamin E which nourishes the beard.</span></li><li style=\"box-sizing: border-box;list-style: disc;overflow-wrap: break-word;margin: 0.0px;\"><span style=\"box-sizing: border-box;color: #0f1111;\">Argan Oil: It prevents drying of the hair shafts. Provides deep nourishment of hair and prevents frizz and split ends.</span></li><li style=\"box-sizing: border-box;list-style: disc;overflow-wrap: break-word;margin: 0.0px;\"><span style=\"box-sizing: border-box;color: #0f1111;\">Uneven Patchy Beard: Get rid of dry frizzy beard hair by applying beard oil for patchy beard. All three rich ingredients keep your beard smooth & shiny. Paraben-free and Silicone-free.</span></li><li style=\"box-sizing: border-box;list-style: disc;overflow-wrap: break-word;margin: 0.0px;\"><span style=\"box-sizing: border-box;color: #0f1111;\">Treats Beardruff: Just like our scalp, the skin of the chin under the beard becomes prone to dryness. Beard oil that provides the required nutrients to the underlying skin, nourishing it and hence preventing dryness and formation of beardruff.</span></li><li style=\"box-sizing: border-box;list-style: disc;overflow-wrap: break-word;margin: 0.0px;\"><span style=\"box-sizing: border-box;color: #0f1111;\">Promotes Beard Hair Growth: Keep your beard nourished with beard oil for men hair by promoting beard growth. It removes the dryness and makes the beard more manageable.</span></li></ul><div style=\"box-sizing: border-box;width: 366.812px;color: #0f1111;\"><div style=\"box-sizing: border-box;overflow: hidden;margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><ul style=\"box-sizing: border-box;margin: 0.0px 0.0px 0.0px 18.0px;color: #0f1111;padding: 0.0px;list-style: disc;margin-left: 10.0px;\"><li style=\"box-sizing: border-box;list-style: disc;overflow-wrap: break-word;margin: 0.0px;\"><span style=\"box-sizing: border-box;color: #0f1111;\">Beard Growth Oil for Men: For long, people have been neglecting the usage of proper grooming products for the beard. But now, with beard grooming products becoming more and more popular, the benefits that the oil can reap cannot be ignored.</span></li><li style=\"box-sizing: border-box;list-style: disc;overflow-wrap: break-word;margin: 0.0px;\"><span style=\"box-sizing: border-box;color: #0f1111;\">Usage: Apply the oil twice a day. Once in the morning and once in the evening.</span></li></ul></div></div><p style=\"margin: 0;padding: 8.0px 0;white