(526, 'Tresemme Biotin Repair7 with Biotin&Pro-Bond Complex Shampoo-700Ml', 0, 0, NULL, 'seller', 261, 10, 70, 360, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/aed77b4f39222ea014e622df810647c4.jpg\"]', 'https://static-01.daraz.com.np/p/aed77b4f39222ea014e622df810647c4.jpg', 'https://static-01.daraz.com.np/p/aed77b4f39222ea014e622df810647c4.jpg', 'https://static-01.daraz.com.np/p/aed77b4f39222ea014e622df810647c4.jpg', '', '', 'Health & Beauty , Hair Care , Shampoo,,', '<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"box-sizing: border-box;color: #0f1111;\">Tresemme Biotin Repair 7 with Biotin & Pro-Bond Complex Shampoo 700 ml.Biotin+ Repair 7 range, formulated with biotin & pro-bond complex contains a patented blend of molecules that penetrate inside the hair fibre to restore broken bonds caused by hair damage.The formulation reinforces the protein structure of each hair strand to visibly repair 7 types of styling damage in just one use: whether you blow dry, bleach, brush, straighten, colour, braid and/or curl your hair! Our Biotin+ Repair 7 strengthens each strand of your hair, inside and out; protecting your hair so you can keep on styling, without worrying about damage. Start your routine by gently cleansing your hair with Biotin+ Repair 7 shampoo to visibly repair your hair in just one use. Apply.And if you are looking for an extra boost of protection, use our Biotin+ Repair 7 primer protection spray for easier hair styling with additional heat protection whilst adding shine.If you think TRESemmé Biotin+ Repair 7 Shampoo repairs your hair, don\'t keep it a secret. Leave a review and share your tips. Biotin+ Repair 7 is part of TRESemmé Pro Collection.</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span></span></p>', '<ul>\n	<li>Biotin+ Repair 7 range, formulated with biotin &amp; pro-bond complex contains a patented blend of molecules that penetrate inside the hair fibre to restore broken bonds ca