to its new formulation enriched with hyaluronic acid, glycerin, and aloe vera which offer a 24h moisturization to the skin all the while its careful selection of color adjusting pigments confers a natural unified skin tone.</li>\n	<li>Moreover, this beauty product has a wide range of shades within the undertones cool, neutral and warm. Simultaneously, it offers a medium coverage that can be built.</li>\n	<li>This polyvalent make-up product naturally mimics the &quot;naked-skin&quot; sensation and provides comfort throughout the day. Its composition grants an easy application, even for the less experienced users, therefore, it is easy to spread on the face.</li>\n	<li>You may apply the foundation with a make-up sponge or with a dense straight top brush. To point out that its packaging is robust, heavy and luxurious. The pump attached to the glass tube comes as a more hygienic option that avoids waste.</li>\n	<li>\n	<p>Furthermore, note that this product is non-comedogenic and adapts to all skin types. Also, this dermatologically-tested product has a high-tolerance composition, thus being suitable even for sensitive skin.</p>\n	</li>\n	<li>\n	<p>Ultimately, the natural finishing of this foundation combined with anti-pollutant properties and SPF17 result in a luminous, unified and smooth complexion.</p>\n	</li>\n</ul>_<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"color: #212529;font-family: none;font-size: 17.6px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: left;text-indent: 0.0px;text-transform: none;white-space: normal;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;display: inline;float: none;\">ALOE BARBADENSIS LEAF JUICE POWDER, *******, AQUA/WATER, BUTYLENE GLYCOL, CAPRYLYL GLYCOL, *******, CI 15850 / RED