(561, 'Revlon T&G Foundation Warm Mist 20ml', 0, 0, NULL, 'seller', 261, 10, 71, 363, 590, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/2ae87958463dc9c5a2a39afbd2cef2fb.jpg\"]', 'https://static-01.daraz.com.np/p/2ae87958463dc9c5a2a39afbd2cef2fb.jpg', 'https://static-01.daraz.com.np/p/2ae87958463dc9c5a2a39afbd2cef2fb.jpg', 'https://static-01.daraz.com.np/p/2ae87958463dc9c5a2a39afbd2cef2fb.jpg', '', '', 'Health & Beauty , Makeup , Face , Foundation,', '', '<ul>\n	<li>Revlon presents touch and glow moisturising makeup to give you an ultra even coverage by hiding all lines and streaks on your face.</li>\n	<li>Revlon touch and glow moisturising makeup has a light water based formulation that smoothens and moisturizes skin to make you look naturally radiant. It&rsquo;s a light to medium coverage foundation that hides minor imperfections and evens out complexion for a soft, dewy glow.</li>\n	<li>The light formula doesn&rsquo;t clog pores and can be used everyday. How to apply? Apply on clean skin. Take a small amount and blend it thoroughly using your fingertips or an applicator.</li>\n	<li>Start applying down the centre of your face to forehead, nose and chin. Layer more if necessary until you get the desired coverage. How to remove? Always remove the makeup before sleeping to maintain a healthy skin tone. Use a makeup remover which best suits your skin water based, oil based or cream based. Cleanse, tone and moisturize your face.</li>\n</ul>', 615.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 1, 0, 2, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Revlon T&G Foundation Warm Mist 20ml price in Nepal', '', NULL, NULL, 'revlon-t-g-foundation-warm-mist-20ml12946', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:27:00', '2022-06-09 22:27:00'),
