(582, 'Revlon250 ColorStay Liquid Foundation  for Combination/Oily Skin 1.0 oz Fresh Beige, ,', 0, 0, NULL, 'seller', 261, 10, 71, 363, 590, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/28aa0f958efc2ae122ffa14f07b68124.jpg\"]', 'https://static-01.daraz.com.np/p/28aa0f958efc2ae122ffa14f07b68124.jpg', 'https://static-01.daraz.com.np/p/28aa0f958efc2ae122ffa14f07b68124.jpg', 'https://static-01.daraz.com.np/p/28aa0f958efc2ae122ffa14f07b68124.jpg', '', '', 'Health & Beauty , Makeup , Face , Foundation,', '', '<ul>\n	<li>OIL FREE FOUNDATION FOR OILY SKIN: Our cult-favorite, lightweight, liquid matte foundation is made to control oil and shine with an oil-free formula</li>\n	<li>ALL DAY, LONG LASTING MAKEUP: Our Revlon ColorStay liquid foundation wears for up to 24 hours so no matter what your day brings&mdash;that&#39;s why we call it &quot;Life-Tested&quot;. Plus, it has a broad spectrum SPF 15 sun protection boost</li>\n	<li>MEDIUM / BUILDABLE COVERAGE: Blend a small dab for medium coverage and a naturally flawless, smooth look. Build up for full coverage as desired</li>\n	<li>LIVE BOLDLY WITH REVLON MAKEUP: Revlon has the high-quality, high-pigment, bold makeup you need to be yourself. Create any look&mdash;day to night, weekday to weekend&mdash;with our longwear color eyeshadows, eyeliners, matte or shiny lipsticks, and more</li>\n</ul>', 2095.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 1, 0, 9, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Revlon250 ColorStay Liquid Foundation  for Combination/Oily Skin 1.0 oz Fresh Beige, , price in Nepal', '', NULL, NULL, 'revlon250-colorstay-liquid-foundation-for-combination-oily-skin-1-0-oz-fresh-beige-12967', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:27:01', '2022-06-09 22:27:01'),
(583, 'Maybelline Fit Me!110 Matte Poreless Foundation Normal Oily 30ml', 0, 0, NULL, 'seller', 261, 10, 71, 363, 590, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/75e7d79666daee7e0ea2e8e2ee905a2a.jpg\"]', 'https://static-01.daraz.com.np/p/75e7d79666daee7e0ea2e8e2ee905a2a.jpg', 'https://static-01.daraz.com.np/p/75e7d79666daee7e0ea2e8e2ee905a2a.jpg', 'https://static-01.daraz.com.np/p/75e7d79666daee7e0ea2e8e2ee905a2a.jpg', '', '', 'Health & Beauty , Makeup , Face , Foundation,', '<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"font-family: none;\"></span></p><p style=\"margin: 0;padding: 8.0px 0;line-height: 1.4375rem;font-size: 0.95rem;color: #333333;font-weight: 400;\"><strong style=\"margin: 0.0px;padding: 0.0px;font-weight: 700;\">Maybelline Fit Me Matte & Poreless Foundation</strong><span></span><span>is specially formulated for normal to oily skin due to the presence of micro-powders that not only control shine, absorbing excess oils, but also blurs pores minimizing them. Given that, this unique formula is perfect to mitigate the issues of this type of skin. It also contains Glycerin, which has the ability to draw moisture from the air and bind it to the skin, keeping it moisturized and shielded from environmental sources of irritation. And, in addition, the presence of Tocopherol in its formula also provides antioxidant properties shielding the skin from free radicals.</span></p><p style=\"margin: 0;padding: 8.0px 0;line-height: 1.4375rem;font-size: 0.95rem;color: #333333;font-weight: 400;\"><span>With a lightweight liquid texture, this foundation blends well and allows you enough time to build up coverage as needed. That being said, this foundation has not only the ability to mattify and refine pores but also to help cover imperfections. You can easily control the amount of product you want due to its practical plastic tube presentation. With a non-comedogenic formula, it provides a pleasant velvet finish, granting you a beautiful natural-looking coverage. Besides, because it is light and has a practical size, it is also perfect to take with you in your bag.</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span></span></p>', '<ul>\n	<li>Ideal for normal to oily skin, our exclusive matte foundation formula features</li>\n	<li>micro-powders to control shine and blur pores.</li>\n	<li>Pore minimizing foundation.</li>\n	<li>Dermatologist tested</li>\n	<li>Allergy tested</li>\n	<li>Non-comedogenic<br />\n	&nbsp;</li>\n</ul>_<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"font-family: none;\"></span></p><p style=\"margin: 0;padding: 8.0px 0;line-height: 1.4375rem;font-size: 0.95rem;color: #333333;font-weight: 400;\"><strong style=\"margin: 0.0px;padding: 0.0px;font-weight: 700;\">Maybelline Fit Me Matte & Poreless Foundation</strong><span></span><span>is specially formulated for normal to oily skin due to the presence of micro-powders that not only control shine, absorbing excess oils, but also blurs pores minimizing them. Given that, this unique formula is perfect to mitigate the issues of this type of skin. It also contains Glycerin, which has the ability to draw moisture from the air and bind it to the skin, keeping it moisturized and shielded from environmental sources of irritation. And, in addition, the presence of Tocopherol in its formula also provides antioxidant properties shielding the skin from free radicals.</span></p><p style=\"margin: 0;padding: 8.0px 0;line-height: 1.4375rem;font-size: 0.95rem;color: #333333;font-weight: 400;\"><span>With a lightweight liquid texture, this foundation blends well and allows you enough time to build up coverage as needed. That being said, this foundation has not only the ability to mattify and refine pores but also to help cover imperfections. You can easily control the amount of product you want due to its practical plastic tube presentation. With a non-comedogenic formula, it provides a pleasant velvet finish, granting you a beautiful natural-looking coverage. Besides, because it is light and has a practical size, it is also perfect to take with you in your bag.</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span></span></p>', 1600.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 0, 0, 5, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Maybelline Fit Me!110 Matte Poreless Foundation Normal Oily 30ml price in Nepal', '', NULL, NULL, 'maybelline-fit-me-110-matte-poreless-foundation-normal-oily-30ml12968', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:27:01', '2022-06-09 22:27:01'),
