(600, 'Bella Vita Organic Day Glow Sunscream Spf30+ 200g', 0, 0, NULL, 'seller', 261, 10, 76, 402, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/028666ceb58f86fd0ef4254ffeb1d500.jpg\"]', 'https://static-01.daraz.com.np/p/028666ceb58f86fd0ef4254ffeb1d500.jpg', 'https://static-01.daraz.com.np/p/028666ceb58f86fd0ef4254ffeb1d500.jpg', 'https://static-01.daraz.com.np/p/028666ceb58f86fd0ef4254ffeb1d500.jpg', '', '', 'Health & Beauty , Skin Care , Sunscreen and Aftersun,,', '<div style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span>This multi-purpose body lotion is infused with the goodness of sandalwood, vitamin E, shea butter, and mango butter which help in intense skin hydration, moisturisation, and nourishment.</span></div><div style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span>How to use: Using this lotion is simple. Dispense the body lotion into the palm of your hand. Massage gently till the cream is absorbed fully. Apply evenly all over the body. And allow at least 10 mins before you step out in the sun.The efficacy & feel of a premium skincare product that comes in an affordable and pocket-friendly bottle is what this new age ayurvedic product is all about. Regular and proper application of this lotion on skin can make it look bright, smooth, and clear naturally.</span></div>', '<ul>\n	<li>Day Glow Sunscreen Face and Body Lotion is a natural &amp; ayurvedic formulation that naturally protects your skin from the harmful UVA/UVB rays and the damage caused by them. It has SPF 30+ in it which shields your skin from heat and is the perfect sunblock for everyone. Use this sunscreen lotion for the body to stay away from tanning, sun burns &amp; skin burns that may lead to inflammation and redness.</li>\n	<li>This Tan Removal Sunscreen Lotion Cream is the best sunscreen for oily skin types especially because its light-weight formula is non-sticky and non-greasy and doesn&#39;t leave a white cast on the skin. It also helps deal with blemishes and skin pigmentation. It can be used by people of all skin type and all genders, even acne prone skin.</li>\n</ul>_<div style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span>This multi-purpose body lotion is infused with the goodness of sandalwood, vitamin E, shea butter, and mango butter which help in intense skin hydration, moisturisation, and nourishment.</span></div><div style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span>How to use: Using this lotion is simple. Dispense the body lotion into the palm of your hand. Massage gently till the cream is absorbed fully. Apply evenly all over the body. And allow at least 10 mins before you step out in the sun.The efficacy & feel of a premium skincare product that comes in an affordable and pocket-friendly bottle is what this new age ayurvedic product is all about. Regular and proper application of this lotion on skin can make it look bright, smooth, and clear naturally.</span></div>', 750.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 0, 0, 3, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Bella Vita Organic Day Glow Sunscream Spf30+ 200g price in Nepal', '', NULL, NULL, 'bella-vita-organic-day-glow-sunscream-spf30-200g12985', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:27:01', '2022-06-09 22:27:01'),
