ithout any harmful chemicals that may cause irritation or itching like some antiperspirant products.</li>\n	<li>24H protection with this natural deodorizer, you can rest assured that you&rsquo;ll be safe from embarrassing body odor. It only contains organic essential oils for fragrance (Sweet orange oil &amp; Peppermint)</li>\n</ul>_<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"color: #272727;font-family: none;font-size: 14.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: left;text-indent: 0.0px;text-transform: none;white-space: normal;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;display: inline;float: none;\">Earth Rhythm Natural Deodorant With Matcha Green Tea Extracts is completely natural, edible, free from aluminum, alcohol, phthalates and parabens. USDA certified, dairy free, gluten free, soy free, cruelty-free, BPA free, paraben free and sulfate free.</span></p>', 1150.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 0, 0, 2, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Earth Rhythm Natural Deodorant/Roll On With Matcha Green 50g price in Nepal', '', NULL, NULL, 'earth-rhythm-natural-deodorant-roll-on-with-matcha-green-50g13005', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:27:01', '2022-06-09 22:27:01'),
