ate areas like under the arms, do not continue using it.</span></p><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span></span></p>', 699.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 1, 0, 3, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'The Men Company Non Gas Body Perfume Rouge 120ml price in Nepal', '', NULL, NULL, 'the-men-company-non-gas-body-perfume-rouge-120ml13007', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:27:01', '2022-06-09 22:27:01'),
