(679, 'Loreal Paris Indestructible Extreme Gel 150ml', 0, 0, NULL, 'seller', 261, 10, 70, 358, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/60b30fd211e543649bf5408b5d12e571.jpg\"]', 'https://static-01.daraz.com.np/p/60b30fd211e543649bf5408b5d12e571.jpg', 'https://static-01.daraz.com.np/p/60b30fd211e543649bf5408b5d12e571.jpg', 'https://static-01.daraz.com.np/p/60b30fd211e543649bf5408b5d12e571.jpg', '', '', 'Health & Beauty , Hair Care , Hair Styling,,', '<div></div>', '<ul>\n	<li>Loreal Studio Indestructible Gel Extreme Hold 150ml</li>\n	<li>Loreal Studio Line Indestructible Gel is the 1st styling gel from LOreal Paris which allows your style to bounce-back. Hand, hood and helmut resistant.</li>\n	<li>No messing with your style. Technological innovation, style memorising effect: for extreme hold with elastic resistance.</li>\n	<li>Designed to bounce back and resist squashing.</li>\n</ul>_<div></div>', 850.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 0, 0, 3, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Loreal Paris Indestructible Extreme Gel 150ml price in Nepal', '', NULL, NULL, 'loreal-paris-indestructible-extreme-gel-150ml13064', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:27:02', '2022-06-09 22:27:02'),
