(681, 'Loreal Paris Line Studio Volume Max Mousse 200ml', 0, 0, NULL, 'seller', 261, 10, 70, 358, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/7d8f13b7aa98f63aa5efaf9b394fd627.jpg\"]', 'https://static-01.daraz.com.np/p/7d8f13b7aa98f63aa5efaf9b394fd627.jpg', 'https://static-01.daraz.com.np/p/7d8f13b7aa98f63aa5efaf9b394fd627.jpg', 'https://static-01.daraz.com.np/p/7d8f13b7aa98f63aa5efaf9b394fd627.jpg', '', '', 'Health & Beauty , Hair Care , Hair Styling,,', '<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"font-family: none;\"></span></p><p style=\"box-sizing: border-box;margin: 0;padding: 8.0px 0;border: none;outline: none;color: #3d3d3d;font-family: roboto , sans-serif;font-size: 19.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: start;text-indent: 0.0px;text-transform: none;white-space: pre-wrap;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;\"><span>Now, before getting into the latest and trending products in the hair mousses, do you know there are different types of them too?</span></p><ul style=\"box-sizing: border-box;margin: 0.0px 0.0px 20.0px 25.0px;padding: 0.0px;border: none;outline: none;color: #3d3d3d;font-family: roboto , sans-serif;font-size: 19.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: start;text-indent: 0.0px;text-transform: none;white-space: normal;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;list-style: disc;margin-left: 10.0px;\"><li style=\"box-sizing: border-box;margin: 0.0px 0.0px 10.0px;padding: 0.0px;border: none;outline: none;\"><span>Do you have thin and frizzy hair? Do you dream of having thick bouncy and shiny hair? Voluminizing hair mousses are just for you. They alter and bring the air to look fuller, thicker and silky.</span></li><li style=\"box-sizing: border-box;margin: 0.0px 0.0px 10.0px;padding: 0.0px;border: none;outline: none;\"><span>Is your hair difficult to manage and also difficult to style? There are special firm hold mousses just for you. Now turn your hair flexible and easy to manage with these firm hold mousses.</span></li><li style=\"box-sizing: border-box;margin: 0.0px 0.0px 10.0px;padding: 0.0px;border: none;outline: none;\"><span>If you want just a common everyday mousse for regular usage and routine or casual styling, you can go with any other drugstore mousses.</span></li><li style=\"box-sizing: border-box;margin: 0.0px 0.0px 10.0px;padding: 0.0px;border: none;outline: none;\"><span>Further, some mousses come in spray form as well as in the form of the storage container. You can decide the preferable mode of mousse according to your tastes and needs.</span></li></ul><p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span></span></p>', '<ul>\n	<li>n case you love styling, this can be your best friend. It provides defense and brings in ease to style, twist, and bounce your hair as you prefer</li>\n	<li>Do you have thin hair? Or do you love having and flaunting voluminous hair? The hair mousse can help you with this. It boosts volume and brings in a shiny, thick effect.</li>\n	<li>Any hair is natural to suck pollution and dirt to its scalp. The hair mousse protects from all dirt and damage to hair.</li>\n	<li>Further, any plans for hairstyling? Try out hair mouse before you begin the procedure. This can act as a heat protectant too.</li>\n	<li>If you have dry and frizzy hair, hair mousses can help you to bring shine and definition and fight against the dryness too.</li>\n</ul>_<p style=\"margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"><span style=\"font-family: none;\"></span></p><p style=\"box-sizing: border-box;margin: 0;padding: 8.0px 0;border: none;outline: none;color: #3d3d3d;font-family: roboto , sans-serif;font-size: 19.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: start;text-indent: 0.0px;text-transform: none;white-space: pre-wrap;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;\"><span>Now, before getting into the latest and trending products in the hair mousses, do you know there are different types of them too?</span></p><ul style=\"box-sizing: border-box;margin: 0.0px 0.0px 20.0px 25.0px;padding: 0.0px;border: none;outline: none;color: #3d3d3d;font-family: roboto , sans-serif;font-size: 19.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: start;text-indent: 0.0px;text-transform: none;white-space: normal;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-thickness: initial;text-decoration-style: initial;text-decoration-color: initial;list-style: disc;margin-left: 10.0px;\"><li style=\"box-sizing: border-box;margin: 0.0px 0.0px 10.0px;padding: 0.0px;border: none;outline: none;\"><span>Do you have thin and frizzy hair? Do you dream of having thick bouncy and shiny hair? Voluminizing hair mousses are just for you. They alter and bring the air to look fuller, thicker and silky.</span></li><li style=\"box-sizing: border-box;margin: 0.0px 0.0px 10.0px;padding: 0.0px;border: none;outline: none;\"><span>Is your hair difficult to manage and also difficult to style? There are special firm hold mousses just for you. Now turn your hair flexible and easy to manage with these firm hold mousses.</span></li><li style=\"box-sizing: border-box;margin: 0.