(704, 'Revlon Colorstay Concealer 030 Light/Medium', 0, 0, NULL, 'seller', 261, 10, 71, 363, 589, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/4f8b2acb2989f134cf05b6ce03374252.jpg\"]', 'https://static-01.daraz.com.np/p/4f8b2acb2989f134cf05b6ce03374252.jpg', 'https://static-01.daraz.com.np/p/4f8b2acb2989f134cf05b6ce03374252.jpg', 'https://static-01.daraz.com.np/p/4f8b2acb2989f134cf05b6ce03374252.jpg', '', '', 'Health & Beauty , Makeup , Face , Concealer,', '', '<ul>\n	<li>FULL COVERAGE CONCEALER: This full coverage concealer makeup minimizes the appearance of dark under eye circles and conceals blemishes without caking, clumping, or flaking. Our lightweight concealer brightens the eye area and blends seamlessly</li>\n	<li>LONG LASTING, ALL DAY STAYING POWER: Time-release technology in our longwearing liquid concealer makeup balances imperfections and help makeup look flawless all day</li>\n	<li>FLAWLESS FACE: Create a flawless face with our longwearing liquid concealer makeup. Using the wand tip, dab on and gently pat it in with your ring finger to blend. Use with Revlon ColorStay foundation, finishing powder, and blush to complete your show-stopping makeup look</li>\n	<li>AVAILABLE IN 18 SHADES: Perfect concealer for dark circles, it offers 18 shades to match your skin tone, from light, medium, olive, deep, and dark skin tones with cool, warm, or natural undertones</li>\n	<li>LIVE BODLY MAKEUP: Revlon has the high-quality, high-pigment, bold liquid makeup you need to be yourself. Create any look&mdash;day to night, weekday to weekend&mdash;with our longwear eye makeup, face makeup, foundations, matte or shiny lipsticks, and more</li>\n</ul>\n\n<p>&nbsp;</p>', 1985.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 1, 0, 2, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Revlon Colorstay Concealer 030 Light/Medium price in Nepal', '', NULL, NULL, 'revlon-colorstay-concealer-030-light-medium13089', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:27:03', '2022-06-09 2