(748, 'Revlon Colorburst Matte Balm Stain Rendezvous-040', 0, 0, NULL, 'seller', 261, 10, 71, 364, 597, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/18b6669c822503377449d4e71152b8d6.jpg\"]', 'https://static-01.daraz.com.np/p/18b6669c822503377449d4e71152b8d6.jpg', 'https://static-01.daraz.com.np/p/18b6669c822503377449d4e71152b8d6.jpg', 'https://static-01.daraz.com.np/p/18b6669c822503377449d4e71152b8d6.jpg', '', '', 'Health & Beauty , Makeup , Lips , Lip Tint,', '', '<ul>\n	<li>The Sultry&nbsp;<em>matte balm</em>&nbsp;glides on super smooth and even, and is super pigmented. One swipe and you&#39;re good to go! Honey is more of a neutral pink color but stands&nbsp;..</li>\n	<li>I&#39;ve been using the balm stain in Crush nearly every single day since the product was released. I was going to pick up a new one a few days ago and to my utter shock and dismay learned that it was discontinued!</li>\n	<li>This is tragic (and such a first world problem, I know), but this product was GENUINELY perfect. The best stain I have ever used, and I have tried MANY. The formula was so amazing and did not contain anything I&#39;m allergic to.</li>\n	<li>It wore beautifully throughout the day and was so easy to rehydrate just by using a basic lip balm. Excuse me while I go cry in a corner and try to figure out what to do with my life, now that my ultimate lip product is gone lol.</li>\n</ul>\n\n<p>&nbsp;</p>', 1755.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 0, 0, 6, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Revlon Colorburst Matte Balm Stain Rendezvous-040 price in Nepal', '', NULL, NULL, 'revlon-colorburst-matte-balm-stain-rendezvous-04013133', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:27:04', '2022-06-09 22:27:04'),
