(752, 'Revlon Colorburst Matte Balm - 220 Showy', 0, 0, NULL, 'seller', 261, 10, 71, 364, 597, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/c4bbf380147646d57f854bca56bf992e.jpg\"]', 'https://static-01.daraz.com.np/p/c4bbf380147646d57f854bca56bf992e.jpg', 'https://static-01.daraz.com.np/p/c4bbf380147646d57f854bca56bf992e.jpg', 'https://static-01.daraz.com.np/p/c4bbf380147646d57f854bca56bf992e.jpg', '', '', 'Health & Beauty , Makeup , Lips , Lip Tint,', 'Revlon Matte Balms are the lip crayons with all the color and moisture you have been craving for a bold, matte look.Retractable chubby crayon that is easy to use and can go anywhere with you. It is a perfect combination of color and rich, luxurious moisture. Also, it does not require any sharpener. It\'s Triple Butter Complex to give you a bold and beautiful lip. It\'s a burst of matte color with a balm-like feel for easy, comfortable wear.', '<ul><li>100% genuine (the seller guarantees the authenticity of the product.)</li><li>Velvety, vibrant, and bold color</li><li>Balm-like moisture for a bold and moisturized lip</li><li>Infused with a Triple Butter Complex of shea, mango, and coconut butter</li><li>Retractable chubby crayon and no sharpener required</li></ul>_Revlon Matte Balms are the lip crayons with all the color and moisture you have been craving for a bold, matte look.Retractable chubby crayon that is easy to use and can go anywhere with you. It is a perfect combination of color and rich, luxurious moisture. Also, it does not require any sharpener. It\'s Triple Butter Complex to give you a bold and beautiful lip. It\'s a burst of matte color with a balm-like feel for easy, comfortable wear.', 1200.00, 0.00, 0, '[]', '[]', '[]', NULL, 0, 1, 0, 4, '', NULL, NULL, NULL, NULL, 'flat_rate', 0.00, 0, 'Revlon Colorburst Matte Balm - 220 Showy price in Nepal', '', NULL, NULL, 'revlon-colorburst-matte-balm-220-showy13137', 0.00, 0, 0.00, NULL, 0, NULL, NULL, '2022-06-09 22:27:04', '2022-06-09 22:27:04'),
