(767, 'Pupa Pupart Gold Make Up Palette 10.9g - Classic Shades', 0, 0, NULL, 'seller', 261, 10, 71, 1221, 0, 0, 0, '[\"https:\\/\\/static-01.daraz.com.np\\/p\\/290ac37773e3e14c8566548e91b10bde.jpg\"]', 'https://static-01.daraz.com.np/p/290ac37773e3e14c8566548e91b10bde.jpg', 'https://static-01.daraz.com.np/p/290ac37773e3e14c8566548e91b10bde.jpg', 'https://static-01.daraz.com.np/p/290ac37773e3e14c8566548e91b10bde.jpg', '', '', 'Health & Beauty , Makeup , Makeup Palettes & Sets,,', '<p style=\"font-family: none;margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"></p><p style=\"box-sizing: inherit;margin: 0;padding: 8.0px 0;color: #363636;font-family: arial , helvetica , sans-serif;font-size: 12.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: start;text-indent: 0.0px;text-transform: none;white-space: pre-wrap;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-style: initial;text-decoration-color: initial;\">Take your makeup collection to new heights with the Pupa Pupart Gold Make Up Palette - Classic Shades, an 18 piece palette for the eyes, lips and face.</p><p style=\"box-sizing: inherit;margin: 0;padding: 8.0px 0;color: #363636;font-family: arial , helvetica , sans-serif;font-size: 12.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: start;text-indent: 0.0px;text-transform: none;white-space: pre-wrap;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-style: initial;text-decoration-color: initial;\">A one-stop shop for all beauty needs, this gold lip adorned palette has everything you need to create a show-stopping makeup look. Perfect for travel or as a gift for a makeup maven, this comprehensive palette is bursting with beauty treasures, including decadent eyeshadows, lustrous lip glosses and more.</p><p style=\"box-sizing: inherit;margin: 0;padding: 8.0px 0;color: #363636;font-family: arial , helvetica , sans-serif;font-size: 12.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: start;text-indent: 0.0px;text-transform: none;white-space: pre-wrap;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-style: initial;text-decoration-color: initial;\"></p><span></span><br class=\"Apple-interchange-newline\"/>', '<p>The palette contains:</p>\n\n<ul>\n	<li><b>Pupa Compact Blusher 2.5g x1:</b>&nbsp;An instant pick-me up, this pretty-in-pink rosy hue will give the cheeks a healthy flush of colour.</li>\n	<li><b>Pupa All Over Powder 0.79ml x1:</b>&nbsp;An excellent way to round-off any makeup look, this highlighting powder will create a gorgeous glow on the high points of the face and across the d&eacute;collet&eacute;.</li>\n	<li><b>Pupa Concealer 0.79ml x1:</b>&nbsp;Creamy and unifying, this multi-purpose concealer will immediately banish dark circles and cover-up unwanted blemishes.</li>\n	<li><b>Pupa Primer 0.79ml x1:</b>&nbsp;The perfect base for your eyeshadow, this cream primer will improve the longevity of your look.</li>\n	<li><b>Pupa Compact Eyeshadows 0.6g x6:</b>&nbsp;With everything from a matte black shadow to an everyday selection of wearable neutral shades, this eyeshadow offering will create an endless array of eye-catching looks.</li>\n	<li><b>Pupa Lip Glosses 0.37ml x6:</b>&nbsp;Packed with pigment and shine, this selection of subtle pinks and purple lip glosses will give your look a vibrant pop of glamorous colour.</li>\n	<li><b>Pupa Double Applicators x2:</b>&nbsp;A handy addition to any makeup collection, the double applicators included will help to blend out eyeshadow with precision.</li>\n</ul>_<p style=\"font-family: none;margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"></p><p 