any beauty lover.</p><br class=\"Apple-interchange-newline\">', '<p>The palette contains:</p>\n\n<ul>\n	<li><b>Pupa Compact Blusher 2.5g x1:</b>&nbsp;A ultra-feminine pink, this English rose blusher will give the cheeks an immediate boost of vitality.</li>\n	<li><b>Pupa All Over Cream 0.79ml x1:</b>&nbsp;Destined to give your complexion a boost of radiance, this cream highlighter has a brightening hue that instantly illuminates.</li>\n	<li><b>Pupa Concealer 0.79ml x1:</b>&nbsp;This creamy concealer will reduce the appearance of dark circles and imperfections for a flawless skin result.</li>\n	<li><b>Pupa Primer 0.79ml x1:</b>&nbsp;A must-have in every makeup stash, this handy primer will improve the longevity of your look and minimise eyeshadow creasing.</li>\n	<li><b>Pupa Compact Eyeshadows 0.6g x6:</b>&nbsp;A sure-fire way to make a statement of the eyes, this 6 piece eyeshadow offering has everything from neutral shades to deep blacks hues.</li>\n	<li><b>Pupa Lip Glosses 0.37ml x6:</b>&nbsp;A vibrant harmony of rich purple hues, this selection of high-shine lip glosses dress your lips in an immediate wash of shiny colour.</li>\n	<li><b>Pupa Double Applicators x2:</b>&nbsp;Excellent when you&rsquo;re on-the-go, the double applicators will create the perfect blend.</li>\n</ul>_<p style=\"font-family: none;margin: 0;padding: 8.0px 0;white-space: pre-wrap;\"></p><p style=\"box-sizing: inherit;margin: 0;padding: 8.0px 0;color: #363636;font-family: arial , sans-serif;font-size: 12.0px;font-style: normal;font-variant-ligatures: normal;font-variant-caps: normal;font-weight: 400;letter-spacing: normal;orphans: 2;text-align: start;text-indent: 0.0px;text-transform: none;white-space: pre-wrap;widows: 2;word-spacing: 0.0px;-webkit-text-stroke-width: 0.0px;background-color: #ffffff;text-decoration-style: initial;text-decoration-color: initial;\">Let their creativity run wild with the Pupa Pupart Red Make Up Palette - Smokey Shades, a red lip adorned makeup palette for the eye